(814, 1674, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar.png);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Request an Energy Audit " weight="400" style="normal" position="center"]Regardless if you are looking to upgrade your business, home, or school it all begins here. Let us know what you are looking for and we can begin the process.[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay=""]<p>Energy audits are the first step in saving you money on your monthly utility bill. During an energy audit, our trained and certified Energy Auditors use a variety of diagnostic tools to determine where hot and cool air escapes from your home and identify which appliances are costing you too much money to operate.</p><p>This waste can cost homeowners, businesses, and institutions hundreds or thousands of dollars annually. As such, we recommend that anyone who is interested in saving money should start with our comprehensive&nbsp;energy audit to understand your potential savings. Beyond even the financial gains, making your home or business more energy efficient can increase the overall comfort and value. Plus, saving energy is good for the environment and the community as a whole.</p>[/tw_column][tw_column title="Energy%20Audit%20Request%20Form" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay=""]<p>[contact-form-7 id="1742" title="Main Contact"]</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_map title="" size="col-md-8" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" type="boxed"]<iframe width="100%" height="450" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d409101.8053107774!2d-119.722656!3d36.76798000000001!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x80945e9921fac2a3%3A0xb2c365667f3f6ae7!2s5114+E+Clinton+Way+%23111%2C+Fresno%2C+CA+93727!5e0!3m2!1sen!2sus!4v1427922095709"></iframe><br /><small><a href="https://www.google.com/maps/place/5114+E+Clinton+Way+%23111,+Fresno,+CA+93727/@36.76798,-119.722656,10z/data=!4m2!3m1!1s0x80945e9921fac2a3:0xb2c365667f3f6ae7&amp;source=embed"></iframe>[/tw_map][tw_tab title="" size="col-md-4" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" position="top"][tw_tab_item title="Corporate Office" title_icon="fa-map-marker"]<p>&nbsp;</p><p>5114 E. Clinton Way, #111<br />Fresno, CA 93727</p>[/tw_tab_item][tw_tab_item title="Operations Offices" title_icon="fa-map-marker"]<p style="color: #797979;"><strong>Visalia:</strong><br />6678 Avenue 304, Suite C1<br />Visalia, CA 93291</p><p style="color: #797979;"><strong>Modesto:</strong><br />1341 McWilliams Way, Unit A<br />Modesto, CA 95351</p>[/tw_tab_item][/tw_tab]</div><div class="row">[tw_service title="" size="col-md-3" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" service_style="style_1" thumb_type="fi" service_thumb_width="50" service_thumb="" fi_size="35" fi_padding="25" fi_color="#fff" fi_bg_color="#0da6b4" fi_border_color=" " fi_rounded="0" fi_rounded_size="50" fi_icon="\nicon-social-twitter\n" cc_type="text" cc_line_width