tle="" size="col-md-4" class="" layout_size="col-md-12" row_type="row" animation="fadeInRight" animation_delay="" service_style="style_1" thumb_type="fi" service_thumb_width="20" service_thumb="" fi_size="64" fi_padding="2" fi_color="#FCB500" fi_bg_color=" " fi_border_color=" " fi_rounded="0" fi_rounded_size="0" fi_icon="\nicon-home\n" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="RESIDENTIAL HOME EFFICIENCY" more_text="I want to save money on my utility bill" more_url="http://henergy.staging.wpengine.com/energy-efficiency/residential/" more_target="_self"]Our holistic approach helps homeowners Discover, Solve and Manage their energy bills so that financial resources can be reinvested back into their families.[/tw_service]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style="background-color:#f2f2f2;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p><img class="alignnone wp-image-2177 " src="http://henergy.wpengine.com/wp-content/uploads/2014/02/schoolchildren-300x200.jpg" alt="" width="429" height="286" /></p>[/tw_column]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" text="Comprehensive Health & Safety Audit" weight="400" style="normal" position="left"][/tw_heading]</div><div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p>[tw_list][tw_list_item animation="fadeIn" animation_delay="" item_icon="fa-check-square"]Comprehensive Audit with Every Assessment &nbsp;[/tw_list_item][tw_list_item animation="fadeIn" animation_delay="" item_icon="fa-check-square"]Fully Detailed Report Disclosing our Findings and Recommendations &nbsp;[/tw_list_item][tw_list_item animation="fadeIn" animation_delay="" item_icon="fa-check-square"]We are your California <a href="http://henergy.staging.wpengine.com/energy-efficiency/">energy efficiency experts</a>[/tw_list_item][/tw_list] [tw_button size="waves-shortcode" size="medium" rounded="false" style="flat shadow" color="#176734" link="/contact-2/energy-audit/" target="_self"]Request an Energy Audit[/tw_button]</p>[/tw_column]</div>[/tw_layout]</div><div style="margin-bottom:-80px"></div></div></div><div class="row-container dark bg-pattern" style="background-color:#0070a2;"><div class="container"><div class="row"><div style="margin-top:-40px"></div>[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" text="We Help You Keep Your Money Where It Matters Most" weight="400" style="normal" position="center"]Let <a href="http://henergy.wpengine.com/">Highlands Energy Services</a> save you money by reducing the amount of energy you use. From simple <a href="http://henergy.wpengine.com/">weatherization</a> measures like caulking windows, weather stripping doors, and adding insulation, to more complex jobs such as installing dual-pane windows, a more efficient pool pump, or a new A/C unit – the bottom line will be reduced energy bills for you and your family – and that’s great news for every family’s bottom line![/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container dark bg-fixed" style="background-color:#001b26;overflow: hidden;position:relative;"><div class="video-mask"></div><div class="video-mask-color"></div><div class="background-video"><div id="jquery_jplayer_1689" class="jp-jplayer jp-jplayer-bgvideo" data-pid="1689" data-m4v="http://henergy.wpengine.com/wp-content/uploads/2014/07/009880197-electricity-meter-time-lapse.mp4" data-thumb=""></div></div><div class="container" style="position:relative; z-index:4"><div class="row"><div style="margin-top:-0px"></div>[tw_layout bg_type="video" size="col-md-6" layout_custom_class=""]<div class="row">[tw_milestones title="" size="col-md-4" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" animation="bounceInUp" animation_delay="100" milsetone_type="style_2" thumb_type="fi" image="" fi_size="70" fi_padding="20" fi_color="#fcb612" fi_bg_color=" " fi_border_color="#fcb612" fi_rounded="0" fi_rounded_size="0" fi_icon="\nicon-energy\n" mile_title="MILLION Therms Saved" count="5"][tw_milestones title="" size="col-md-4" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" animation="fadeInUpBig" animation_delay="500" milsetone_type="style_2" thumb_type="fi" image="" fi_size="60" fi_padding="20" fi_color="#fcb612" fi_bg_color="" fi_border_color="#fcb612" fi_rounded="0" fi_rounded_size="0" fi_icon="\nicon-drop\n" mile_title="MILLION Gallons of Water Saved" count="830"][tw_milestones title="" size="col-md-4" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" animation="fadeInUpBig" animation_delay="300" milsetone_type="style_2" thumb_type="fi" image="" fi_size="70" fi_padding="20" fi_color="#fcb612" fi_bg_color=" " fi_border_color="#fcb612" fi_rounded="0" fi_rounded_size="0" fi_icon="\nfa-bar-chart-o\n" mile_title="Energy Efficient Water Heaters Installed" count="9326"]</div>[/tw_layout][tw_layout bg_type="video" size="col-md-6" layout_custom_class=""]<div class="row">[tw_milestones title="" size="col-md-4" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" animation="bounceInUp" animation_delay="700" milsetone_type="style_2" thumb_type="fi" image="" fi_size="70" fi_padding="20" fi_color="#fcb612" fi_bg_color="" fi_border_color="#fcb612" fi_rounded="0" fi_rounded_size="0" fi_icon="\nicon-bulb\n" mile_title="MILLION Kilowatt Hours Saved" count="23"][tw_milestones title="" size="col-md-4" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" animation="fadeInUpBig" animation_delay="900" milsetone_type="style_2" thumb_type="fi" image="" fi_size="70" fi_padding="20" fi_color="#fcb612" fi_bg_color="" fi_border_color="#fcb612" fi_rounded="0" fi_rounded_size="0" fi_icon="\nicon-graph\n" mile_title="% Increase in Office Building Efficiency" count="30"][tw_milestones title="" size="col-md-4" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" animation="fadeInUpBig" animation_delay="1100" milsetone_type="style_2" thumb_type="fi" image="" fi_size="70" fi_padding="20" fi_color="#fcb612" fi_bg_color="" fi_border_color="#fcb612" fi_rounded="0" fi_rounded_size="0" fi_icon="\nfa-money\n" mile_title="MILLION Dollars Saved on Utility Bills - EVERY YEAR!" count="38"]</div>[/tw_layout]</div><div style="margin-bottom:-0px"></div></div></div><div class="row-container light bg-scroll" style="background-color:#f2f2f2;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_accordion title="Why%20Choose%20Us" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay=""][tw_accordion_item title="We Care About You - We Want You To Save Money!" color="#176734" animation="fadeInUp" animation_delay="" expand="true"]<p style="color: #060807;">&nbsp;We believe a home should be a comfortable, safe and affordable living environment. &nbsp;Our holistic approach helps homeowners Discover, Solve and Manage their energy bills so that financial resources can be reinvested back into their families.</p>[/tw_accordion_item][tw_accordion_item title="30 Years of Experience Serving California" color="#176734" animation="none" animation_delay="" expand="false"]<p style="color: #060807;">We are an award winning Energy group that has been nationally recognized for our innovative solutions in California. Since 1985 we have been serving over 100, 000 Utility customers, helping them save energy and money each month. In 2008, Highlands Energy Services began to expand its reach in the Energy Savings Assistance Program and as a result another 30,000 customers were served, plus additional offices were opened throughout the Central San Joaquin Valley.</p>[/tw_accordion_item][tw_accordion_item title="We Give back to the Community" color="#176734" animation="none" animation_delay="" expand="false"]<p style="color: #060807;">Everything we do, every decision we make begins with the question, "Why?" Our entire executive culture is shaped by what we find when we answer that question, and it always results in the same conclusion: We do what we do to give back to our community. As good neighbors, we measure our company on more than just profits. Our “multiple bottom-line” concept compel on our ability to DO WELL to those we serve as well as GIVE BACK to our communities.</p>[/tw_accordion_item][tw_accordion_item title="We Make It Easy For You" color="#176734" animation="none" animation_delay="" expand="false"]<p style="color: #060807;">It all begins with our comprehensive energy audit. It is our mission to develop a sustainable plan that can help meet California''s energy needs while still retaining the quality of life for all our residents. We will proudly assess your business, school, and residence for possible safety hazards or energy crisis in order to save you money. We offer extensive services that range from simple assessments to full infrastructure retrofits.</p>[/tw_accordion_item][/tw_accordion]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_column title="Latest%20California%20Energy%20News" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay=""]<div class="tw-element carousel-container col-md-6 tw-animate-gen" data-animation="fadeInUp" data-animation-delay="0" data-animation-offset="90%"><div class="waves-carousel-post list_carousel carousel-anim"><div class="caroufredsel_wrapper" style="display: block; text-align: start; float: none; top: auto; right: auto; bottom: auto; left: auto; z-index: auto; margin: 0px; overflow: hidden; position: relative; width: 1168px; height: 404px;"><ul class="waves-carousel" style="text-align: left; float: none; position: absolute; top: 0px; right: auto; bottom: auto; left: 0px; margin: 0px; width: 3504px; height: 404px;"><li style="width: 262px;"><div class="carousel-thumbnail overlay-container"><a href="http://henergy.staging.wpengine.com/wp-content/uploads/2014/07/file49056088_f736db93.jpg"><img class="alignnone wp-image-2191 size-medium" src="http://henergy.staging.wpengine.com/wp-content/uploads/2014/07/file49056088_f736db93-300x200.jpg" alt="" width="300" height="200" /></a><br /><div class="image-overlay">&nbsp;</div></div><div class="carousel-content"><h3 class="carousel-title"><a href="http://henergy.wpengine.com/?page_id=2026">Highlands Energy reaching out to Superintendents</a></h3><div class="carousel-meta clearfix"><span class="date">17 July 2014</span><span class="categories-links"> - <a title="View all posts in Daily Inspiration" href="http://henergy.wpengine.com/?page_id=2026" rel="category tag">Daily Inspiration</a>, <a title="View all posts in Freelance" href="http://henergy.wpengine.com/?page_id=2026" rel="category tag">Freelance</a></span></div><p>Proposition 39 opens the funding floodgates for Central Valley Schools</p></div></li><li style="width: 262px;"><div class="carousel-thumbnail overlay-container" style="height: 201px;"><img style="height: 217px;" src="http://rturner.gpnworld.com/inc/newspics/2010-03-two-awards.png" alt="8864977481_d61248a096_o" /><div class="image-overlay" style="/* height: 201px;">&nbsp;</div></div><div class="c