 size="col-md-3" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="1200" service_style="style_4" thumb_type="fi" service_thumb_width="50" service_thumb="" fi_size="28" fi_padding="15" fi_color="#fff" fi_bg_color="#0DA6B4" fi_border_color=" " fi_rounded="0" fi_rounded_size="5" fi_icon="\nicon-users\n" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="About Us" more_text="Read More" more_url="http://henergy.staging.wpengine.com/about-us-2/" more_target="_self"]We are a local Central Valley company that seeks to improve the living conditions of our neighbors. To do this we must offering tools to not only lower utility bills but educate, develop, and ultimately create self-sufficiency throughout our community.[/tw_service]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll container-border-top" style="background-color:#f2f2f2;"><div class="container"><div class="row"><div style="margin-top:-30px"></div>[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="Our%20Partners" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay=""][/tw_column]</div><div class="row">[tw_partner title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="500"][tw_partner_item title="CASBO" link="http://www.casbo.org/" thumb="http://henergy.wpengine.com/wp-content/uploads/2014/07/casbo.png"][tw_partner_item title="ASHRAE" link="" thumb="http://henergy.wpengine.com/wp-content/uploads/2014/02/ashrae.png"][tw_partner_item title="BPI" link="" thumb="http://henergy.wpengine.com/wp-content/uploads/2014/07/bpi.png"][tw_partner_item title="California Alliance Group" link="" thumb="http://henergy.wpengine.com/wp-content/uploads/2014/07/cag.png"][tw_partner_item 