253BWe%2520recommend%2520upgrades%2520that%2520are%2520not%2520only%2520safer%2520but%2520save%2520energy.%253C%252Fli%253E%253Cli%253E%253Cb%253EWindow%252FGlazing%253C%252Fb%253E%253A%2520Older%2520schools%2520tend%2520to%2520have%2520single%2520pane%2520windows%2520which%2520are%2520encased%2520in%2520metal%2520that%2520are%2520known%2520to%2520leak%2520energy%2520that%2520allow%2520significant%2520heat%2520transfer%2520and%2520glare%253Cb%253E.%2526nbsp%253B%253C%252Fb%253E%253C%252Fli%253E%253C%252Ful%253E%253Cp%2520style%253D%2522color%253A%2520%2523060807%253B%2522%253E%253Cb%253EHVAC%2520Repair%2520and%2520Replacement%253C%252Fb%253E%253A%2520%2526nbsp%253BA%2520well%2520maintained%2520HVAC%2520unit%2520can%2520help%2520save%2520tens%2520of%2520thousands%2520of%2520dollars%2520on%2520energy%2520costs%2520while%2520ensuring%2520a%2520comfortable%2520learning%2520environment.%253C%252Fp%253E%22%7D%2C%222%22%3A%7B%22title%22%3A%22MANAGE%22%2C%22title_icon%22%3A%22fa-long-arrow-right%22%2C%22content%22%3A%22%253Cp%2520style%253D%2522color%253A%2520%2523060807%253B%2522%253EManagement%2520is%2520the%2520most%2520critical%2520phase%2520for%2520LEA%25E2%2580%2599s%2520and%2520must%2520include%253A%253C%252Fp%253E%253Cul%2520style%253D%2522color%253A%2520%2523060807%253B%2522%253E%253Cli%253E%253Cb%253EVerification%253A%2526nbsp%253B%253C%252Fb%253EWork%2520is%2520verified%2520through%25203rd%2520party%2520and%2520state%2520regulators%2520to%2520ensure%2520work%2520was%2520completed%2520properly%2520and%2520in%2520accordance%2520to%2520the%2520terms%2520of%2520the%2520source%2520funding.%253C%252Fli%253E%253Cli%253E%253Cb%253ECompliance%253A%2526nbsp%253B%253C%252Fb%253ERegulations%2520require%2520compliance%2520from%2520California%2520State%2520Architect%25E2%2580%2599s%2520Office%252C%2520California%2520Department%2520of%2520Education%252C%2520and%2520California%2520Energy%2520Commission%2520as%2520well%2520as%2520local%2520government%2520and%2520LEAs%2520Board%25