2%2C%22btn_url%22%3A%22http%253A%252F%252Fhenergy.wpengine.com%252F%253Fpage_id%253D2085%22%2C%22btn_target%22%3A%22_self%22%7D%7D%7D%7D%7D%7D%2C%224%22%3A%7B%22admin_row_name%22%3A%22No%20Named%20Layout%22%2C%22row_custom_class%22%3A%22%22%2C%22row_custom_id%22%3A%22%22%2C%22background_color%22%3A%22%20%22%2C%22background_image%22%3A%22%22%2C%22add_background_image%22%3A%22Upload%22%2C%22background_style%22%3A%22scroll%22%2C%22background_video%22%3A%22%22%2C%22add_background_video%22%3A%22Upload%22%2C%22admin_row_closed%22%3A%22false%22%2C%22row_layout%22%3A%22half%22%2C%22row_contrast%22%3A%22light%22%2C%22padding_top%22%3A%22%22%2C%22padding_bottom%22%3A%22%22%2C%22layouts%22%3A%7B%220%22%3A%7B%22size%22%3A%22col-md-0%22%2C%22items%22%3A%7B%7D%7D%2C%221%22%3A%7B%22size%22%3A%22col-md-6%22%2C%22items%22%3A%7B%220%22%3A%7B%22slug%22%3A%22column%22%2C%22size%22%3A%22col-md-12%22%2C%22item_title%22%3A%22%22%2C%22custom_class%22%3A%22%22%2C%22animation%22%3A%22fadeInUp%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22column_content%22%3A%22%253Cp%253E%253Cimg%2520class%253D%2522alignnone%2520wp-image-2177%2520%2522%2520src%253D%2522http%253A%252F%252Fhenergy.wpengine.com%252Fwp-content%252Fuploads%252F2014%252F02%252Fschoolchildren-300x200.jpg%2522%2520alt%253D%2522%2522%2520width%253D%2522429%2522%2520height%253D%2522286%2522%2520%252F%253E%253C%252Fp%253E%22%7D%7D%7D%7D%2C%222%22%3A%7B%22size%22%3A%22col-md-6%22%2C%22items%22%3A%7B%220%22%3A%7B%22slug%22%3A%22heading%22%2C%22size%22%3A%22col-md-12%22%2C%22item_title%22%3A%22%22%2C%22custom_class%22%3A%22%22%2C%22animation%22%3A%22fadeInUp%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22text%22%3A%22Schools%253A%2520Download%2520the%2520Prop.%252039%2520RFQ%2520Template%22%2C%22weight%22%3A%22400%22%2C%22style%22%3A%22normal%22%2C%22position%22%3A%22left%22%2C%22description%22%3A%22%22%7D%7D%2C%221%22%3A%7B%22slug%22%3A%22column%22%2C%22size%22%3A%22col-md-12%22%2C%22item_title%22%3A%22%22%2C%22custom_class%22%3A%22%22%2C%22animation%22%3A%22fadeInUp%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22column_content%22%3A%22%253Cp%253E%255Btw_list%255D%255Btw_list_item%2520animation%253D%2522fadeIn%2522%2520animation_delay%253D%2522%2522%2520item_icon%253D%2522fa-check-square%2522%255DEasy%2520to%2520use%2520template%2520will%2520get%2520the%2520process%2520started%2526nbsp%253B%255B%252Ftw_list_item%255D%255Btw_list_item%2520animation%253D%2522fadeIn%2522%2520animation_delay%253D%2522%2522%2520item_icon%253D%2522fa-check-square%2522%255DOur%2520focus%2520is%2520to%2520help%2520schools%2520navigate%2520the%2520%2526nbsp%253Bfunding%2520process%2520%255B%252Ftw_list_item%255D%255Btw_list_item%2520animation%253D%2522fadeIn%2522%2520animation_delay%253D%2522%2522%2520item_icon%253D%2522fa-check-square%2522%255DWe%2520are%2520your%2520local%252C%2520Central%2520Valley%2520CASBO%2520Strategic%2520Alliance%2520Partner%255B%252Ftw_list_item%255D%255B%252Ftw_list%255D%253C%252Fp%253E%253Cp%253E%255Btw_button%2520size%253D%2522waves-shortcode%2522%2520size%253D%2522medium%2522%2520rounded%253D%2522false%2522%2520style%253D%2522flat%2520shadow%2522%2520color%253D%2522%2523176734%2522%2520link%253D%2522%252Fwp-content%252Fuploads%252F2014%252F07%252FRFQ-DESIGN-BUILD-ENERGY-EFFICIENCY-AND-PROPOSITION-39-TEMPLATE.docx%2522%2520target%253D%2522_blank%2522%255DDownload%2520the%2520RFQ%2520Template%255B%252Ftw_button%255D%255Btw_button%2520size%253D%2522waves-shortcode%2522%2520size%253D%2522medium%2522%2520rounded%253D%2522false%2522%2520style%253D%2522flat%2520shadow%2522%2520color%253D%2522%2523176734%2522%2520link%253D%2522%252F%253Fpage_id%253D2029%2522%2520target%253D%2522_self%2522%255DI''d%2520Like%2520More%2520Info%255B%252Ftw_button%255D%253C%252Fp%253E%22%7D%7D%7D%7D%7D%7D%7D'),
(2012, 2024, 'waves_metabox_shortcode', '<div class="row-container dark bg-scroll" style="background-color:#0675A5;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" text="Prop. 39 For Better Schools" weight="400" style="normal" position="center"][/tw_heading]</div><div class="row">[tw_column title="" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay=""]<p><img class="alignnone wp-image-2195" src="http://henergy.wpengine.com/wp-content/uploads/2014/07/schoolchildren3-300x199.jpg" alt="schoolchildren3" width="555" height="369" /></p>[/tw_column][tw_column title="" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay=""]<p>Highlands Energy Services is a building performance contractor that specializes in energy efficiency. &nbsp;The company traces its roots back to 1985 when then, under the name Century Weatherization Services, began serving low income PG&amp;E customers through the Energy Savings Assistance Program. &nbsp;For the next 28 years, Century Weatherization Services would serve over 100,000 Utility customers, helping them save energy and money each month.</p><p>In 2008, Century Weatherization Services changed its named to Highlands Energy Services and began to expand its reach in the Energy Savings Assistance Program. &nbsp;From 2008 through 2012 another 30,000 customers were served, additional offices were opened throughout the Central San Joaquin Valley and began work for multiple Utility Companies. &nbsp;Highlands Energy Services focuses on utility company contracts and to date, has served over 140,000 utility ratepayers, generating over $30 million dollars in energy savings annually.</p><p>&nbsp;</p><p>[tw_button size="waves-shortcode" size="large" rounded="false" color=" " link="http://henergy.wpengine.com/wp-content/uploads/2014/07/RFQ-DESIGN-BUILD-ENERGY-EFFICIENCY-AND-PROPOSITION-39-TEMPLATE.docx" target="_self"] DOWNLOAD the RFQ TEMPLATE&nbsp;[/tw_button]</p><p><br /><br /></p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style="background-color:#fcfcfc;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_text_carousel title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="slideDown" animation_delay="" duration="3000" timeout="4000"][tw_text_carousel_item]<h2>Improve Learning Through Better School Facilities</h2><p><a href="http://henergy.wpengine.com/wp-content/uploads/2014/07/schoolchildren2.jpg"><img class="alignnone size-full wp-image-2192" src="http://henergy.wpengine.com/wp-content/uploads/2014/07/schoolchildren2.jpg" alt="schoolchildren2" width="1000" height="665" /></a></p><p><i>Bringing Learning Back to School.</i> It is our goal to help increase test scores. &nbsp;According to the California Department of Education, School Facilities Services Division, improving your school facilities has a direct impact on cognitive functioning.</p><p>[tw_button size="waves-shortcode" size="large" rounded="false" color=" " link="http://www.cde.ca.gov/ls/fa/re/documents/learnercenter.pdf#search=glen%20earthman&amp;view=FitH&amp;pagemode=none" target="_blank"]&nbsp;VIEW CDE STUDY&nbsp;[/tw_button]</p>[/tw_text_carousel_item][tw_text_carousel_item]<h2>Better School Facilities Lead to Improved Learning: Official Report</h2><p><a href="http://henergy.wpengine.com/wp-content/uploads/2014/02/schoolchildren.jpg"><img class="alignnone size-full wp-image-2177" src="http://henergy.wpengine.com/wp-content/uploads/2014/02/schoolchildren.jpg" alt="schoolchildren" width="800" height="534" /></a></p><p>According to the California Department of Education, School Facilities Services Division, improving your school facilities has a direct impact on cognitive functioning.</p><p>[tw_button size="waves-shortcode" size="large" rounded="false" color=" " link="http://www.cde.ca.gov/ls/fa/re/documents/learnercenter.pdf#search=glen%20earthman&amp;view=FitH&amp;pagemode=none" target="_blank"]&nbsp;VIEW CDE STUDY&nbsp;[/tw_button]</p>[/tw_text_carousel_item][/tw_text_carousel]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" text="How Overall Compliance Rating affects Learning" weight="300" style="normal" position="left"]These are just a few examples. Read the California Department of Education’s Official Report to learn more.[/tw_heading]</div><div class="row">[tw_chart_circle title="36%20Point%20Increase%20in%20California%20API%20Scores" size="col-md-3" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" chart_circle_pos="style_2" cc_type="fi" cc_line_cap="butt" cc_line_width="12" cc_text="80%" cc_percent="36" cc_size="120" cc_font_size="50" cc_font_color="#176734" cc_color="#0da6b4" cc_track_color="#f5f5f5" cc_icon="\nfa-lightbulb-o\n"][tw_chart_circle title="14%25%20Lower%20Student%20Suspension%20Rates" size="col-md-3" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" chart_circle_pos="style_2" cc_type="fi" cc_line_cap="butt" cc_line_width="12" cc_text="80%" cc_percent="14" cc_size="120" cc_font_size="50" cc_font_color="#176734" cc_color="#0da6b4" cc_track_color="#f5f5f5" cc_icon="\nfa-heart\n"][tw_chart_circle title="20%25%20Faster%20Student%20Progress%20on%20Math" size="col-md-3" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" chart_circle_pos="style_2" cc_type="fi" cc_line_cap="butt" cc_line_width="12" cc_text="80%" cc_percent="20" cc_size="120" cc_font_size="50" cc_font_color="#176734" cc_color="#0da6b4" cc_track_color="#f5f5f5" cc_icon="\nfa-rocket\n"][tw_chart_circle title="26%25%20Faster%20Student%20Progress%20in%20Reading" size="col-md-3" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" chart_circle_pos="style_2" cc_type="fi" cc_line_cap="butt" cc_line_width="12" cc_text="80%" cc_percent="26" cc_size="120" cc_font_size="50" cc_font_color="#176734" cc_color="#0da6b4" cc_track_color="#f5f5f5" cc_icon="\nfa-book\n"]</div><div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p><em>"We believe classrooms should be a safe and comfortable environment that fosters creativity, imagination and personal discovery. We help schools Discover, Solve and Manage their energy bills so that financial resources can be reinvested back into the classrooms.”</em></p><p>[tw_button size="waves-shortcode" size="medium" rounded="false" color="#0070a2" link="http://www.cde.ca.gov/ls/fa/re/documents/learnercenter.pdf#search=glen%20earthman&amp;view=FitH&amp;pagemode=none" ]Read the Official Report[/tw_button]&nbsp;[tw_button size="waves-shortcode" size="medium" rounded="false" color="#176734" link="/?page_id=2026" ]View Our&nbsp;Case Studies[/tw_button]</p><p>&nbsp;</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style=""><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInRight" animation_delay=""]<p>[tw_chart_pie size="waves-shortcode" type="Doughnut"]State Funds for Central Valley Schools[tw_chart_pie_item value="30" color="#176734" fill_text="General Funds for regular expenses"][tw_chart_pie_item value="20" color="#0070a2" fill_text="Funds to invest in new programs"][tw_chart_pie_item value="50" color="#fcb712" fill_text="Funds to upgrade schools"][/tw_chart_pie]</p><p>Let Highlands Energy Services help you reorganize your budget to reinvest back into the classroom through Energy Efficiency.</p>[/tw_column]</div>[/tw_layout][tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_tab title="School%20Retrofitting" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" position="right"][tw_tab_item title="Increasing Learning" title_icon=""]<p>By improving schools, students will experience better learning environments which will increase overall learning and facilitate for a brighter central valley.</p>[/tw_tab_item][tw_tab_item title="Putting Resources Back into the Classroom" title_icon=""]<p>By renovating the classroom schools will lower utility costs giving them the opportunity to reinvest those funds back into the students to improve our communities.</p>[/tw_tab_item][tw_tab_item title="Helping Schools Manage Their Costs" title_icon=""]<p>With better facilities school are able to meet annual budgets and meet student needs.</p>[/tw_tab_item][tw_tab_item title="Improving Student and Faculty Safety" title_icon=""]<p>By having facility assessments schools are better able to prevent accidents and are able to correct potential disasters that threaten school safety.</p>[/tw_tab_item][/tw_tab]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/Yellow-fcb712-bg.png);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_tab title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInLeft" animation_delay="" position="top"][tw_tab_item title="DISCOVER" title_icon=""]<p style="color: #060807;">The Discovery Phase is the first step in determining the best solutions to improve the classroom learning environment. &nbsp;A certified energy assessor will visit the LEA sites and collect information on &nbsp;current conditions to prepare the report on:</p><ul style="color: #060807;"><li><b>Benchmarking</b>: The buildings are compared to other similar school buildings across the state.&nbsp; Benchmarking allows the LEA to start with schools that can be improved the most, first.</li><li><b>Fund Sourcing</b>: Funds through various State programs, grants, allocations and financing vehicles are sourced for the LEA.</li></ul><p style="color: #060807;"><b>Energy Expenditure Plan</b>: Each LEA is required to have a plan (1, 2, 5 years) on making energy efficiency improvements with prioritized measures.&nbsp; The purpose of the plan is to ensure schools complete energy measures that give the greatest improvement first while improving the learning environment.</p>[/tw_tab_item][tw_tab_item title="SOLVE" title_icon="fa-long-arrow-right"]<p style="color: #060807;">We are believers of “reduce before you produce” therefore energy conservation measures that have the lowest cost and greatest improvement are recommended before more expensive options, such as solar.&nbsp; The following solutions to not only reduce energy consumption but also improve the classroom learning environment.</p><ul style="color: #060807;"><li><b>Envelope Seal</b>: The most basic and cost effective measure that seals gaps that cause energy leaks in the building.</li><li><b>Lighting</b>: Upgrading lighting will improve reading and math comprehension and also reduce maintenance and inventory levels of replacements.</li><li><b>Insulation</b>: A properly insulated building improves comfort and reduces drastic temperature changes and need to continually monitor the thermostat.</li><li><b>Water Heaters</b>: regulating hot water temperature is paramount in ensuring student safety. &nbsp;We recommend upgrades that are not only safer but save energy.</li><li><b>Window/Glazing</b>: Older schools tend to have single pane windows which are encased in metal that are known to leak energy that allow significant heat transfer and glare<b>.&nbsp;</b></li></ul><p style="color: #060807;"><b>HVAC Repair and Replacement</b>: &nbsp;A well maintained HVAC unit can help save tens of thousands of dollars on energy costs while ensuring a comfortable learning environment.</p>[/tw_tab_item][tw_tab_item title="MANAGE" title_icon="fa-long-arrow-right"]<p style="color: #060807;">Management is the most critical phase for LEA’s and must include:</p><ul style="color: #060807;"><li><b>Verification:&nbsp;</b>Work is verified through 3rd party and state regulators to ensure work was completed properly and in accordance to the terms of the source funding.</li><li><b>Compliance:&nbsp;</b>Regulations require compliance from California State Architect’s Office, California Department of Education, and California Energy Commission as well as local government and LEAs Board of Educators.</li><li><b>Education:</b>&nbsp;Educational programs for staff and faculty are developed to drive behavioral changes.&nbsp; Energy efficiency gains are driven by continually improving the human aspect of energy consumption.<b></b></li><li><b>Maintenance:</b>&nbsp;Program maintenance is paramount to the LEAs continued success in energy efficiency gains.&nbsp; Maintenance includes the upkeep of the new equipment and continual.</li></ul>[/tw_tab_item][/tw_tab]</div>[/tw_layout][tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" text="View Common Problems Typically Seen in Older School Facilities" bg_color=" " font_size="18" btn_text="Common Problems" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2197" btn_target="_self"][/tw_callout]</div><div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" text="Find Out How Highlands Can Help Your Family" bg_color="" font_size="18" btn_text="Find Out More" btn_color="#fcb712" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2085" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p><img class="alignnone wp-image-2177 " src="http://henergy.wpengine.com/wp-content/uploads/2014/02/schoolchildren-300x200.jpg" alt="" width="429" height="286" /></p>[/tw_column]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" text="Schools: Download the Prop. 39 RFQ Template" weight="400" style="normal" position="left"][/tw_heading]</div><div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p>[tw_list][tw_list_item animation="fadeIn" animation_delay="" item_icon="fa-check-square"]Easy to use template will get the process started&nbsp;[/tw_list_item][tw_list_item animation="fadeIn" animation_delay="" item_icon="fa-check-square"]Our focus is to help schools navigate the &nbsp;funding process [/tw_list_item][tw_list_item animation="fadeIn" animation_delay="" item_icon="fa-check-square"]We are your local, Central Valley CASBO Strategic Alliance Partner[/tw_list_item][/tw_list]</p><p>[tw_button size="waves-shortcode" size="medium" rounded="false" style="flat shadow" color="#176734" link="/wp-content/uploads/2014/07/RFQ-DESIGN-BUILD-ENERGY-EFFICIENCY-AND-PROPOSITION-39-TEMPLATE.docx" target="_blank"]Download the RFQ Template[/tw_button][tw_button size="waves-shortcode" size="medium" rounded="false" style="flat shadow" color="#176734" link="/?page_id=2029" target="_self"]I''d Like More Info[/tw_button]</p>[/tw_column]</div>[/tw_layout]</div></div></div>'),
