(2018, 2025, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallax.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" text="Energy Efficiency" weight="400" style="normal" position="center"]Highlands Energy Services is dedicated to bringing you the best in high quality energy efficiency products. We want to update Fresno in a positive way that will not only effect our lives but also the lives of future generations. For that reason we work with industry leaders to target savings for your home or small business. We also work closely with local school districts to optimize the efficiency and safety of our schools, by doing this we have already experienced a leap in school effectiveness.[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container dark bg-scroll" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/0da6b4-TEAL-bg.png);"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_service title="" size="col-md-4" class="" layout_size="col-md-12" row_type="row" animation="fadeInLeft" animation_delay="" service_style="style_1" thumb_type="fi" service_thumb_width="50" service_thumb="" fi_size="75" fi_padding="25" fi_color="#fff" fi_bg_color="NaN" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="\nfa-lightbulb-o\n" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Discover" more_text="Read More" more_url="" more_target="_blank"][/tw_service][tw_service title="" size="col-md-4" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" service_style="style_1" thumb_type="fi" service_thumb_width="50" service_thumb="" fi_size="75" fi_padding="25" fi_color="#fff" fi_bg_color="NaN" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="\nfa-puzzle-piece\n" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Solve" more_text="Read More" more_url="" more_target="_blank"][/tw_service][tw_service title="" size="col-md-4" class="" layout_size="col-md-12" row_type="row" animation="fadeInRight" animation_delay="" service_style="style_1" thumb_type="fi" service_thumb_width="50" service_thumb="" fi_size="75" fi_padding="25" fi_color="#fff" fi_bg_color="NaN" fi_border_color=" " fi_rounded="0" fi_rounded_size="50" fi_icon="\nfa-wrench\n" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Manage" more_text="Read More" more_url="" more_target="_blank"][/tw_service]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_service title="" size="col-md-3" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" service_style="style_1" thumb_type="fi" service_thumb_width="50" service_thumb="" fi_size="50" fi_padding="25" fi_color="#fcb712" fi_bg_color="NaN" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="\nicon-home\n" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Residental" more_text="Read More" more_url="http://henergy.wpengine.com/?page_id=2085" more_target="_self"][/tw_service][tw_column title="" size="col-md-9" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>&nbsp;</p><hr /><p>We have already saved Central Valley home owners 30% on their utility bills by working closely with PG&amp;E as well as the <a href="http://henergy.wpengine.com/energy-efficiency/">ESAP</a> (Energy Savings Assistance Program) to lower residential communities utility usage thus lowering the total cost of utilities per household. By passing this savings on to the consumer we are able to improve the current condition of the Central Valley and develop our communities for future generations.</p><p>By upgrading your current infrastructure you will be able to reinvest those funds back to where they matter the most, the family.&nbsp;</p><hr /><p>&nbsp;</p>[/tw_column]</div><div class="row">[tw_service title="" size="col-md-3" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" service_style="style_1" thumb_type="fi" service_thumb_width="50" service_thumb="" fi_size="50" fi_padding="25" fi_color="#0070a2" fi_bg_color="NaN" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="\nfa-building-o\n" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Commercial" more_text="Read More" more_url="http://henergy.wpengine.com/?page_id=2083" more_target="_self"][/tw_service][tw_column title="" size="col-md-9" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay=""]<hr /><p>Currently Central Valley businesses are some of the highest consumers of public utilities in the valley. It is our goal to change the improve the economy of the valley by positively improving the total consumption of utilities such as electricity and water through the overall reduction of unnecessary usage. We work directly with PG&amp;E as well as other utility providers to pass savings on to Central Valley businesses so that we can not only help control California''s energy consumption but create sustainable business practices for future generations.</p><p>By partnering with <a href="http://henergy.wpengine.com/">Highlands Energy Services</a> your business will experience lower utility bills and thus an increase in business efficiency and greater profit margins. Find out what Highlands can do for you.</p><hr /><p>&nbsp;</p>[/tw_column]</div><div class="row">[tw_service title="" size="col-md-3" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" service_style="style_1" thumb_type="fi" service_thumb_width="50" service_thumb="" fi_size="50" fi_padding="25" fi_color="#176734" fi_bg_color="NaN" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="\nicon-notebook\n" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Schools" more_text="Read More" more_url="http://henergy.wpengine.com/?page_id=2082" more_target="_self"][/tw_service][tw_column title="" size="col-md-9" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay=""]<hr /><p>&nbsp;<a href="http://henergy.wpengine.com/">Highlands Energy Services</a> is currently working with local Central Valley schools to develop sustainable practices to lower the total utility consumption of our schools. We are also dedicated to increasing the total safety of our students and faculty while they are at school by conducting safety audits that help address problems that may have not been detected in the past.</p><p>By changing small and big things in the schools Highlands Energy has already saved Central Valley School Districts thousands of dollars in over spending thus reducing the utility load on the schools and making it possible for those schools to &nbsp;reinvest those funds where they matter the most, back into the classroom.&nbsp;</p><hr /><p>&nbsp;</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/Green-176734-bg.png);"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" text="Find Out About Retrofitting Your Business" bg_color="" font_size="18" btn_text="Find Out More" btn_color="#0da6b4" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2083" btn_target="_self"][/tw_callout]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInLeft" animation_delay="" text="Find Out About Retrofitting Your Home" bg_color=" " font_size="18" btn_text="Lower Your Utilities" btn_color="#fcb712" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2085" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar.png);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Get your family started towards energy efficiency today!" bg_color="#" font_size="20" btn_text="Contact Us" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2029" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
