(2048, 2030, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallax.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" text="Energy Efficiency Retrofitting" weight="400" style="normal" position="center"]Surprisingly many buildings are spending more on utilities then they really use. By getting an assessment of your building, you might be able to cut your total costs by at least 30%.[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="slideUp" animation_delay="" text="Building a Brighter Central Valley" weight="400" style="normal" position="center"][/tw_heading]</div><div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p>&nbsp;Regardless if you are a business owner, a learning institution or you just want to lower your electric bill at home, <a href="http://henergy.wpengine.com/">Highlands Energy</a> has the plan for you that will help you save on your expenses and give you a chance to reinvest funds back into what really matters to you. The whole process begins with the comprehensive <a href="http://henergy.wpengine.com/">efficiency and safety audit</a> where we will help you discover possible inefficiencies in your current infrastructure. We then work with you to find what is the most important to you and find the best solutions.</p><p>Some of the services that we provide are, efficiency monitoring, safety audits for schools and many others. We also look for possible hazards like gas leaks or asbestos which can be harmful to anyone. Take the first step and contact us today about setting up an efficiency audit and let us help you make our Central Valley cleaner and safer for everyone.</p><p>&nbsp;</p>[/tw_column]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="slideUp" animation_delay="" text="Serving the Central Valley" weight="400" style="normal" position="center"][/tw_heading]</div><div class="row">[tw_service title="" size="col-md-6" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" service_style="style_1" thumb_type="fi" service_thumb_width="50" service_thumb="" fi_size="40" fi_padding="25" fi_color="#fff" fi_bg_color="#fcb712" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="\nicon-umbrella\n" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Efficiency Audits" more_text="Get and Audit" more_url="http://henergy.wpengine.com/?page_id=1674" more_target="_self"][/tw_service][tw_service title="" size="col-md-6" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" service_style="style_1" thumb_type="fi" service_thumb_width="50" service_thumb="" fi_size="40" fi_padding="25" fi_color="#fff" fi_bg_color="#0070a2" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="\nicon-globe\n" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Giving Back" more_text="Volunteer Work" more_url="http://henergy.wpengine.com/?page_id=2031" more_target="_blank"][/tw_service]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style=""><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_chart_graph title="Utility%20Costs%20After%20Retrofit" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" item_height="" type="Line" labels="January , February , March , April"][tw_chart_graph_item datas="60, 50, 45, 40" fill_color="#176734" fill_text=""][/tw_chart_graph]</div>[/tw_layout][tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_column title="About%20Retrofitting" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p>On average our customers receive 30% off of their utilities, making it so that Central Valley residents and business owners can reinvest their resources back where it matters the most. The process begins with an <a href="http://henergy.wpengine.com/">Energy Efficiency Audit</a>, we work look for <a href="http://henergy.wpengine.com/prop-39-schools/common-problem-areas/">Common Problems</a>, such as lead paint and energy waste. After the audit has been completed we will conduct alterations to the business, institutions, or residence to ensure that all buildings comply with our energy standards.</p>[/tw_column]</div><div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInRight" animation_delay="" text="Set up an assessment today!" bg_color="#efefef" font_size="18" btn_text="Get Started" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_self"][/tw_callout]</div><div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInRight" animation_delay="" text="Looking for more information?" bg_color="#efefef" font_size="18" btn_text="View the Case Studies" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2026" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
