(2054, 2031, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-color:#0da6b4;background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar.png);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="We Give Back: That is Who We Are." weight="400" style="normal" position="center"]We are a local experts whose mission is simple, save you and your family money so you can put it where it matters most.[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/Blue-0070a2-bg.png);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_blog title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" layout="simple" category_ids="giving-back" post_count="1" pagination="false" excerpt_count="300" more_text="Read More"]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" text="Our Executive Team" weight="400" style="normal" position="center"]We are proud to serve California[/tw_heading]</div><div class="row">[tw_service title="" size="col-md-4" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" service_style="style_1" thumb_type="image" service_thumb_width="250" service_thumb="http://henergy.wpengine.com/wp-content/uploads/2014/07/Leonel-e1406228915411.jpg" fi_size="28" fi_padding="25" fi_color="#fff" fi_bg_color="#16d1ac" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="fa-cloud" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Leonel Alvarado" more_text="" more_url="" more_target="_blank"]Leonel was “Green” before it was cool to be “Green” having entered the energy conservation industry in 1985.  He brings over 30 years of business and construction experience including an abundance of knowledge and hands on experience in energy efficiency measures and energy trends.  Leonel received this bachelor’s degree from CSU, Fresno in 1973 and is a Service Disabled Veteran and Minority Business Enterprise owner, licensed contractor, Real Estate Broker and was recently certified as a “Blow-In Blanket” Contractor.  He has served as President of the Central Valley Hispanic, Fresno City and County Chambers of Commerce and is currently a member of the Board of Directors with the Fresno Rescue Mission and Rescue the Children.[/tw_service][tw_service title="" size="col-md-4" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" service_style="style_1" thumb_type="image" service_thumb_width="250" service_thumb="http://henergy.wpengine.com/wp-content/uploads/2014/07/Adam-Avila-A10-30-13_1960-e1406229030567.jpg" fi_size="28" fi_padding="25" fi_color="#fff" fi_bg_color="#16d1ac" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="fa-cloud" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Adam Avila" more_text="" more_url="" more_target="_blank"]Adam is the CEO of Highlands Energy Services, he joined the team in 2008 as a project manager and shortly gained large contracts with PG&amp;E as well as Southern California Gas Company. He considers himself a student who''s focus is to serve the Central Valley in everything from developing the dam at the Shaver Lake to renovating the Veterans Home in Fresno. His primary goal is to improve the living conditions of Central Valley residents through installing energy efficient appliances and education. \nAdam is also continually shaping Highlands Energy Services culture to better meet the needs of the Central Valley.[/tw_service][tw_service title="" size="col-md-4" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" service_style="style_1" thumb_type="image" service_thumb_width="250" service_thumb="http://henergy.wpengine.com/wp-content/uploads/2014/07/Steve-Earl-A10-30-13_1949.jpg" fi_size="28" fi_padding="25" fi_color="#fff" fi_bg_color="#16d1ac" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="fa-cloud" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Steve Earl" more_text="" more_url="" more_target="_blank"]Steve Earl is the COO of the Alvardo Group. He reccieved his Associates from Brighton Polytechnic school in the United Kingdom in Electronics Mechanics. He has spent the last ten years developing the valleys sustainable energy practices by working with large housing developers and construction programs. He has connections throughout the state and is continually reshaping the way California residents think about their energy consumption.  He is associated with the U.S. Green Building Council (USGBC), USGBC California, and Centex Homes in order to bring energy savings to the residents and to ensure better business practices across the state.[/tw_service]</div><div class="row">[tw_service title="" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" service_style="style_1" thumb_type="image" service_thumb_width="250" service_thumb="http://henergy.wpengine.com/wp-content/uploads/2014/07/Doug-Scheidt-A10-30-13_1918-e1406228983708.jpg" fi_size="28" fi_padding="25" fi_color="#fff" fi_bg_color="#16d1ac" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="fa-cloud" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Douglas Scheidt" more_text="" more_url="" more_target="_blank"]Douglas received his Project Engineering degree from Cal Poly and brings over 38 years of construction industry experience to Highlands Energy Services.  His many affiliations include the American Society of Civil Engineers where he held the title of 2007 Fresno Branch President; the Associated General Contractors where he has been a District Board Member since 1982; the California State University, Fresno, Construction Management Advisory Board Member and former Lecturer. His vast experience in civil engineering ranges from commercial to industrial and his exceptional coordination and detail skills have greatly benefited clients in completing their projects within budget, on-time and with a high level of accuracy.[/tw_service][tw_service title="" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" service_style="style_1" thumb_type="image" service_thumb_width="250" service_thumb="http://henergy.wpengine.com/wp-content/uploads/2014/07/Jennifer-Baxter-A10-30-13_1945-e1406228880519.jpg" fi_size="28" fi_padding="25" fi_color="#fff" fi_bg_color="#16d1ac" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="fa-cloud" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="Jennifer Baxter" more_text="" more_url="" more_target="_blank"]Jennifer has spent over 12 years of leading successful teams in the areas of Public Relations, Sales, Marketing and Business Development in various sectors such as the healthcare industry, financial institutions, and energy efficiency. Her responsibility for growing the organization’s presence throughout the state of California aligns with her vision to continue strengthening the company as the energy management solution of choice for the Central California market.  She spends much of her time promoting the “Energy Efficiency Movement” by educating business owners, consumers and jurisdiction throughout the valley, as an Energy Efficiency advocate.  She also holds a seat on the advisory board for the Fresno Clean Energy Cluster.[/tw_service]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallax2.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" text="What Can Highlands do for You?" bg_color=" " font_size="18" btn_text="View Our Case Studies" btn_color="#0070a2" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2026" btn_target="_self"][/tw_callout]</div>[/tw_layout][tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" text="Catch Up on Highlands News" bg_color=" " font_size="18" btn_text="Latest News" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2027" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size=