(2445, 2066, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar.png);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Cut Your Electric Bills With Solar Panels" weight="400" style="normal" position="center"]Highlands Energy Services is a building performance contractor that specializes in energy efficiency.  We work with PG&amp;E as well as other utility providers to help you lower your total energy costs. In order to create a more sustainable community it is important that we develop better energy usage practices in our businesses and our homes. One of the best way to do this is to install solar panels. We have already saved California residents thousands of dollars in revenue that can be reinvested back into the places where it is needed most.[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-fixed" style="background-color:#fff;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Why Install Solar Panels?" weight="400" style="normal" position="center"]One of the best ways to save money on utilities is to invest in solar panels and harvesting your own energy from the sun, instead of completely relying on an energy company for all of your energy consumption. We will work with you to find out your energy requirements and other needs in order to find the best solar paneling option for you.[/tw_heading]</div><div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay=""]<p>[tw_callout size="waves-shortcode" text="Want to see how much you can save?" bg_color="#efefef" font_size="18" btn_text="Get An Assessment" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_self"][/tw_callout]</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-fixed" style="background-color:#fff;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="The Pros and Cons of Installing Solar Panels" weight="400" style="normal" position="center"]One of the best ways to save money on utilities is to invest in solar panels and harvesting your own energy from the sun, instead of completely relying on an energy company for all of your energy consumption. We will work with you to find out your energy requirements and other needs in order to find the best solar paneling option for you.[/tw_heading]</div><div class="row">[tw_list title="Pros" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""][tw_list_item animation="none" animation_delay="" item_icon="fa-check"]Harvesting your own energy from the sun can create huge savings on your energy bill.[/tw_list_item][tw_list_item animation="none" animation_delay="" item_icon="fa-check"]Installing solar panels may make you eligible for tax credits from the federal and state government.[/tw_list_item][tw_list_item animation="none" animation_delay="" item_icon="fa-check"]Once installed, Solar Panels require little maintenance.[/tw_list_item][tw_list_item animation="none" animation_delay="" item_icon="fa-check"]Solar energy is a renewable resource. Unlike coal and fossil fuels, we can never run out of solar energy.[/tw_list_item][tw_list_item animation="none" animation_delay="" item_icon="fa-check"]Solar Panels are environmentally friendly, and harvesting solar power does not create pollution, although there are some emissions made during the manufacturing process.[/tw_list_item][/tw_list][tw_list title="Cons" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""][tw_list_item animation="none" animation_delay="" item_icon="fa-times"]The initial cost of installing solar panels can be high. However, with the monthly savings in energy costs, they can pay themselves off in a short amount of time, and provide savings for years to come.[/tw_list_item][tw_list_item animation="none" animation_delay="" item_icon="fa-times"]Solar energy cannot be harvested at night, or during days with cloud-cover. However, it is possible to store excess energy created while the sun is out, which can then be used when it is not.[/tw_list_item][tw_list_item animation="none" animation_delay="" item_icon="fa-times"]Solar panels take up space. However, solar panels are typically installed on roofs, so space is rarely an issue, especially on larger buildings.[/tw_list_item][/tw_list]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="Dedicated%20to%20Saving%20You%20Money" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay=""]<hr /><p style="color: #101010;">We want to help the Central Valley continue to develop. The best way that we can do this is to increase the efficiency of the valley in our businesses, schools, and in our homes. We will work with the utility providers like PG&amp;E to help lower your total costs and save you money that can be reinvested back into the places where they matter the most.</p>[/tw_column]</div><div class="row">[tw_column title="" size="col-md-8" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay=""]<p>On average our customers have experienced savings of 30% off of their total utility expenses through retrofitting and the installation of solar panels. We want to extend these savings to all of the Central Valley residents by first analyzing your energy consumption and then upgrading inefficient systems to new ones. One of the best ways to begin the process is to consider how installing solar panels will benefit your home or business, and then contacting us for an energy audit.</p>[/tw_column][tw_chart_circle title="" size="col-md-4" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" chart_circle_pos="style_1" cc_type="text" cc_line_cap="round" cc_line_width="14" cc_text="30%" cc_percent="30" cc_size="150" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f5f5f5" cc_icon="\nfa-star\n"]</div>[/tw_layout]</div></div></div>'),
