2column_content%22%3A%22%253Cp%253EThe%2520State%2520of%2520California%2520has%2520allocated%2520up%2520to%2520%2524550%2520million%2520in%2520annual%2520funds%2520to%2520improve%2520the%2520energy%2520efficiency%2520of%2520California''s%2520schools%2520and%2520other%2520eligible%2520projects%2520to%2520expand%2520clean%2520energy%2520throughout%2520the%2520state.%2520Highlands%2520Energy%2520Services%2520is%2520working%2520with%2520local%2520school%2520districts%2520as%2520well%2520as%2520utility%2520providers%2520to%2520undergo%2520these%2520changes%2520to%2520provide%2520California%2520schools%2520with%2520safe%2520and%2520effective%2520learning%2520institutions%2520for%2520all%2520of%2520the%2520Central%2520Valleys%2520students%2520and%2520educators.%2526nbsp%253B%253C%252Fp%253E%253Cblockquote%253E%253Cp%253E%2522Eligible%2520local%2520educational%2520agencies%2520(LEAs)%2520%25E2%2580%2594%2520including%2520county%2520offices%2520of%2520education%252C%2520school%2520districts%252C%2520charter%2520schools%2520and%2520state%2520special%2520schools%25E2%2580%2594can%2520request%2520funding%2520by%2520submitting%2520an%2520energy%2520expenditure%2520plan%2520application%2520to%2520the%2520California%2520Energy%2520Commission.%2520For%2520the%2520first%2520year%252C%2520there%2520is%2520an%2520option%2520to%2520receive%2520part%2520or%2520all%2520of%2520a%2520school''s%2520allocation%2520for%2520energy%2520savings%2520planning%2520purposes.%2520The%2520Energy%2520Commission%2520approves%2520plans%2520and%2520works%2520with%2520the%2520California%2520Department%2520of%2520Education%252C%2520which%2520subsequently%2520distributes%2520funds%2520after%2520plans%2520have%2520been%2520approved.%2522%2520%2526nbsp%253B--%253Ca%2520href%253D%2522http%253A%252F%252Fwww.energy.ca.gov%252Fefficiency%252Fproposition39%252F%2522%253Ewww.energy.ca.gov%253C%252Fa%253E%253C%252Fp%253E%253C%252Fblockquote%253E%253Cp%253EHighlands%2520Energy%2520Services%2520will%2520work%2520with%2520you%2520to%2520Discover%252C%2520Solve%252C%2520and%2520Manage%2520your%2520institutions%2520energy%2520consumption%2520to%2520build%2520a%2520brighter%2520and%2520better%2520Central%2520Valley.%2520Take%2520the%2520next%2520step%2520and%2520begin%2520the%2520Energy%2520Efficiency%2520Audit%2520today!%253C%252Fp%253E%22%7D%7D%2C%221%22%3A%7B%22slug%22%3A%22column%22%2C%22size%22%3A%22col-md-12%22%2C%22item_title%22%3A%22%22%2C%22custom_class%22%3A%22%22%2C%22animation%22%3A%22fadeInUp%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22column_content%22%3A%22%253Cp%253E%255Btw_button%2520size%253D%2522waves-shortcode%2522%2520size%253D%2522large%2522%2520rounded%253D%2522false%2522%2520style%253D%2522flat%2520shadow%2522%2520color%253D%2522%2523176734%2522%2520link%253D%2522http%253A%252F%252Fhenergy.wpengine.com%252F%253Fpage_id%253D2024%2522%2520target%253D%2522_self%2522%255DView%2520Case%2520Studies%255B%252Ftw_button%255D%253C%252Fp%253E%22%7D%7D%7D%7D%7D%7D%2C%222%22%3A%7B%22row_custom_class%22%3A%22%22%2C%22row_custom_id%22%3A%22%22%2C%22background_color%22%3A%22%22%2C%22background_image%22%3A%22http%3A%2F%2Fhenergy.wpengine.com%2Fwp-content%2Fuploads%2F2014%2F07%2Fsolar.png%22%2C%22add_background_image%22%3A%22Upload%22%2C%22background_style%22%3A%22parallax%22%2C%22background_video%22%3A%22%22%2C%22add_background_video%22%3A%22Upload%22%2C%22default_row%22%3A%22false%22%2C%22row_layout%22%3A%22half%22%2C%22row_contrast%22%3A%22light%22%2C%22padding_top%22%3A%22%22%2C%22padding_bottom%22%3A%22%22%2C%22layouts%22%3A%7B%220%22%3A%7B%22size%22%3A%22col-md-0%22%2C%22items%22%3A%7B%7D%7D%2C%221%22%3A%7B%22size%22%3A%22col-md-6%22%2C%22items%22%3A%7B%220%22%3A%7B%22slug%22%3A%22callout%22%2C%22size%22%3A%22col-md-12%22%2C%22item_title%22%3A%22%22%2C%22custom_class%22%3A%22%22%2C%22animation%22%3A%22fadeIn%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22text%22%3A%22How%2520much%2520you%2520can%2520save%253F%22%2C%22bg_color%22%3A%22%2523ef