(2472, 2070, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallax.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" text="Changing California''s Energy Needs" weight="400" style="normal" position="center"]Highlands Energy Services comes as good news for Central Valley Residents. It is our mission to produce sustainable change within the valley not only in the local schools, but in the valley''s businesses and residential communities. Take the first step and set up an energy audit of your home, business or institution and we will help you save money so you can reinvest it into your family.[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p>[tw_image_slider size="waves-shortcode" type="slide" padding="0" gallery_list="2195,"]</p>[/tw_column]</div><div class="row">[tw_chart_graph title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" item_height="250px" type="Line" labels="January , February , March , April"][tw_chart_graph_item datas="40,45,50,60" fill_color="#16d1ac" fill_text=""][tw_chart_graph_item datas="40,35,20,30" fill_color="#176734" fill_text=""][/tw_chart_graph]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_column title="From%20the%20Prop%2039%20website" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p>The State of California has allocated up to $550 million in annual funds to improve the energy efficiency of California''s schools and other eligible projects to expand clean energy throughout the state. Highlands Energy Services is working with local school districts as well as utility providers to undergo these changes to provide California schools with safe and effective learning institutions for all of the Central Valleys students and educators.&nbsp;</p><blockquote><p>"Eligible local educational agencies (LEAs) — including county offices of education, school districts, charter schools and state special schools—can request funding by submitting an energy expenditure plan application to the California Energy Commission. For the first year, there is an option to receive part or all of a school''s allocation for energy savings planning purposes. The Energy Commission approves plans and works with the California Department of Education, which subsequently distributes funds after plans have been approved." &nbsp;--<a href="http://www.energy.ca.gov/efficiency/proposition39/">www.energy.ca.gov</a></p></blockquote><p>Highlands Energy Services will work with you to Discover, Solve, and Manage your institutions energy consumption to build a brighter and better Central Valley. Take the next step and begin the Energy Efficiency Audit today!</p>[/tw_column]</div><div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p>[tw_button size="waves-shortcode" size="large" rounded="false" style="flat shadow" color="#176734" link="http://henergy.wpengine.com/?page_id=2024" target="_self"]View Case Studies[/tw_button]</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar.png);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" text="How much you can save?" bg_color="#efefef" font_size="18" btn_text="Get Started" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2029" btn_target="_self"][/tw_callout]</div>[/tw_layout][tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" text="Get the Latest in Highlands News" bg_color="" font_size="18" btn_text="Our News" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2027" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
