(2478, 2071, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/static.squarespace.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" text="Our Awards" weight="400" style="normal" position="center"][/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="Dedicated%20to%20Building%20a%20Brighter%20Future" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay=""]<p>Highlands Energy is a building performance contractor that specializes in energy efficiency. &nbsp;The company traces its roots back to 1985 when then, under the name Century Weatherization Services, began serving low income PG&amp;E customers through the Energy Savings Assistance Program. &nbsp;For the next 28 years, Century Weatherization Services would serve over 100,000 Utility customers, helping them save energy and money each month.</p><p>In 2008, Century Weatherization Services changed its named to Highlands Energy and began to expand its reach in the Energy Savings Assistance Program. &nbsp;From 2008 through 2012 another 30,000 customers were served, additional offices were opened throughout the Central San Joaquin Valley and began work for multiple Utility Companies. &nbsp;Highlands Energy focuses on utility company contracts and to date, has served over 140,000 utility ratepayers, generating over $30 million dollars in energy savings.</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_blog title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" layout="simple" category_ids="uncategorized" post_count="2" pagination="false" excerpt_count="" more_text=""]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar.png);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" text="Start your family towards energy efficiency" bg_color="" font_size="18" btn_text="Get Started" btn_color="#176734" btn_icon="" btn_url="/?page_id=2029" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
