(2579, 2082, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallax2.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" text="School Retrofitting" weight="400" style="normal" position="center"]Highlands Energy Services focuses on utility company contracts and to date, has served over 140,000 utility ratepayers, generating over $30 million dollars in energy savings annually.[/tw_heading]</div><div class="row">[tw_process title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""][tw_process_item title="Discover" animation="slideLeft" animation_delay="200" title_style="light" color="#fcb712" number="1"][tw_process_item title="Solve " animation="slideLeft" animation_delay="400" title_style="light" color="#0070a2" number="2"][tw_process_item title="Manage" animation="slideLeft" animation_delay="600" title_style="light" color="#176734" number="3"][/tw_process]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style=""><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_image_slider title="" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" type="slide" padding="0" gallery_list="2195,2192,2177,"][tw_column title="" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay=""]<p>If children are the future then it is reasonable to assume that the schools are their training ground. Here in the valley many schools are not up to the specks that many of us would like. It is important that we consider how to address the issues of underfunded schools by first asking the question, where is the funding going? In many cases the funding that schools receive goes to pay expenses like lighting and heating. With many of the schools that we have seen most of them overpay in utilities or there is simply to much waste within the schools themselves that allocated budgets simply can''t cover everything.</p><p>There is good news, <a href="http://henergy.wpengine.com/">Highlands Energy Services</a> is here to help serve the Central Valley because we work with major utility providers to lower the amount of energy and other resources that school use. This means that by eliminating wasted utilities schools will be able to reinvest those funds back into the places where they matter the most, the classroom.</p><p>By changing our energy consumption we won''t have to cut music programs or art programs to cover costs, instead the funds can be used to develop self-sufficient schools and students while improving safety of everyone involved in our institutions.</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallax.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" text="Lower Your Schools Utility Bills" bg_color="#efefef" font_size="18" btn_text="Get Started" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_self"][/tw_callout]</div><div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" text="Get Your Community College Started" bg_color="#efefef" font_size="18" btn_text="Find Out More" btn_color="#0da6b4" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2172" btn_target="_self"][/tw_callout]</div>[/tw_layout][tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" text="Get Your Charter School Started" bg_color="#efefef" font_size="18" btn_text="Find Out More" btn_color="#0070a2" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2170" btn_target="_self"][/tw_callout]</div><div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" text="Get Your Public School Started" bg_color="#efefef" font_size="18" btn_text="Find Out More" btn_color="#fcb712" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2172" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
