(2617, 2085, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallax2.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Residential Efficiency" weight="400" style="normal" position="center"]We believe a home should be a comfortable, safe and affordable living environment.  Our holistic approach helps homeowners Discover, Solve and Manage their energy bills so that financial resources can be reinvested back into their families.[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_process title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""][tw_process_item title="Cut Costs" animation="fadeInLeft" animation_delay="" title_style="dark" color="#fcb712" number="1"][tw_process_item title="Increase Safety" animation="fadeInLeft" animation_delay="" title_style="dark" color="#0070a2" number="2"][tw_process_item title="Save Money" animation="fadeInLeft" animation_delay="" title_style="dark" color="#176734" number="3"][/tw_process]</div><div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Saving You Money With 3 Steps" weight="400" style="normal" position="center"]We begin by conducting an assesment of your energy usage and then discuss options for lowering your electric bills. In most cases the greatest benefit in energy efficiency comes from installing solar.[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_chart_pie title="Average%20Utility%20Costs%20Per%20Home%20Breakdown" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" type="Pie"][tw_chart_pie_item value="29" color="#176734" fill_text="Average annual heating cost"][tw_chart_pie_item value="13" color="#0070a2" fill_text="Average cooling cost"][tw_chart_pie_item value="12" color="#fcb712" fill_text="Average annual lighting cost"][tw_chart_pie_item value="13" color="#0da6b4" fill_text="Average annual water heating cost"][tw_chart_pie_item value="5" color="#16d1ac" fill_text="Average annual washer and dryer costs"][tw_chart_pie_item value="28" color="#c7c1c1" fill_text="Other utility costs"][/tw_chart_pie]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_tab title="Residential%20Services" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInDown" animation_delay="" position="left"][tw_tab_item title="Duct-Seal" title_icon=""]<p>&nbsp;</p><p>The average leak in the HVAC ducts are 30%. &nbsp;Sealing these leaks ensures the home is cooled, instead of the attic!</p>[/tw_tab_item][tw_tab_item title="Lighting" title_icon=""]<p>&nbsp;</p><p>Replacing incandescent’s with CFL’s or LED’s can reduce your electricity use by 30%.</p>[/tw_tab_item][tw_tab_item title="Insulation" title_icon=""]<p>&nbsp;</p><p>A properly insulated home improves comfort and reduces drastic temperature changes and the need to continually monitor the thermostat.</p>[/tw_tab_item][tw_tab_item title="Windows" title_icon=""]<p><br />&nbsp;</p><p>Replace outdated windows with dual pane windows, which can be up to 40% more efficient in keeping the temperature regulated, the outdoor noise out, and help improve security and home value.</p>[/tw_tab_item][tw_tab_item title="Water Heaters" title_icon=""]<p>&nbsp;</p><p>We have tank and tankless options, both of which will meet or exceed energy star requirements.</p>[/tw_tab_item][tw_tab_item title="HVAC Repair and Replacement" title_icon=""]<p>&nbsp;</p><p>A well maintained HVAC unit can help save tens of thousands of dollars on energy costs but also provide a comfortable living environment.</p>[/tw_tab_item][tw_tab_item title="Air Purification" title_icon=""]<p>&nbsp;</p><p>Respiratory issues caused by asthma and allergens can be mitigated with whole-house air purifiers.</p>[/tw_tab_item][tw_tab_item title="Pool Pumps" title_icon=""]<p>&nbsp;</p><p>Our Ultra efficient pool pumps have variable speeds and are two to five times more energy efficient that other “energy efficient” pool pumps.</p>[/tw_tab_item][tw_tab_item title="Whole House Fan" title_icon=""]<p>&nbsp;</p><p>The best option in reducing or even eliminate the need to run your air conditioner, in the Central Valley.</p>[/tw_tab_item][/tw_tab]</div><div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p>[tw_service size="waves-shortcode" service_style="style_1" thumb_type="fi" service_thumb_width="50" service_thumb="" fi_size="28" fi_padding="25" fi_color="#fff" fi_bg_color="#16d1ac" fi_border_color="" fi_rounded="0" fi_rounded_size="50" fi_icon="fa-cloud" cc_type="text" cc_line_width="8" cc_text="80%" cc_percent="80" cc_size="100" cc_font_size="30" cc_font_color="#16d1ac" cc_color="#16d1ac" cc_track_color="#f9f9f9" cc_icon="fa-star" service_title="More information about your energy usage" more_text="Read More" more_url="http://www.energystar.gov/ia/products/heating_season_footprint_infographic.html" more_target="_blank"][/tw_service]</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallaxq.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" text="We can help you save money on your energy bill! Lower your utility bills by at least 30%!" bg_color="" font_size="18" btn_text="Get Started" btn_color="#fcb712" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
