(2809, 2169, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallax.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" text="Bringing Energy Back to the Classroom" weight="400" style="normal" position="center"]By lowering your energy related expenses schools can reinvest their resources back where they matter most, the classroom. Brighter lighting means greater learning.[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-3" layout_custom_class=""][/tw_layout][tw_layout bg_type="" size="col-md-9" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-9" class="" layout_size="col-md-9" row_type="row" animation="fadeInUp" animation_delay=""]<p>A certified energy assessor will visit the sites and collect information on &nbsp;current conditions to prepare the report on for all parties. Funds are available through various State programs, grants, allocations through <a href="http://henergy.wpengine.com/prop-39-schools/">Proposition 39</a>.Each LEA is required to have a plan (1, 2, 5 years) on making energy efficiency improvements with prioritized measures. &nbsp;The purpose of the plan is to ensure schools complete energy measures that give the greatest improvement first while improving the learning environment.</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/intellimeter_20130829.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" text="Find Out More About Upgrading Charter Schools" bg_color=" " font_size="18" btn_text="Find Out More" btn_color="#fcb712" btn_icon="" btn_url="/?page_id=2029" btn_target="_self"][/tw_callout]</div><div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" text="Get Your Community College Started" bg_color="" font_size="18" btn_text="Find Out More" btn_color="#16d1ac" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2172" btn_target="_self"][/tw_callout]</div>[/tw_layout][tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" text="How Much Will Your School Can Save?" bg_color="" font_size="18" btn_text="Find Out More" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_self"][/tw_callout]</div><div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay="" text="View Out Case Studies" bg_color="" font_size="18" btn_text="Find Out More" btn_color="#0070a2" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2026" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
