(2834, 2172, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallax.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Upgrading Community Colleges" weight="400" style="normal" position="center"]By upgrading California''s community colleges, not only are more jobs created, but the quality of learning that college students will experience will go up. Better Lighting means better learning and a more productive environment. [/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style=""><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeInUp" animation_delay=""]<p>Highland Energy Services is helping colleges and other higher education institutions lower their utility costs through their Discover, Solve, and Manage process. We have already saved institutions thousands of dollars in expenses and the number continues to grow. By installing solar panels and adjusting central heating and air conditioning, energy consumption can be controlled or maintained to manageable levels thus offering students better learning conditions and faculty better working conditions. For colleges and other institutions the state has allocated funds to upgrade and develop facilities to better utilize resources that we can all benefit/</p><p>When it comes to developing the future of the Central Valley it is important to address the issue of water and energy consumption so that the future generations will be able to enjoy the valley as much as we do.&nbsp;</p>[/tw_column]</div>[/tw_layout][tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_chart_graph title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="none" animation_delay="" item_height="250px" type="Line" labels="January , February , March , April"][tw_chart_graph_item datas="40,45,50,60" fill_color="#ff1232" fill_text=""][tw_chart_graph_item datas="40,25,20,20" fill_color="#16d1ac" fill_text=""][/tw_chart_graph]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallax.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" text="Highlands Can Help Your School Save" bg_color=" " font_size="18" btn_text="Find Out More" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=2024" btn_target="_self"][/tw_callout]</div>[/tw_layout][tw_layout bg_type="parallax" size="col-md-6" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" text="Get Your Institution Started" bg_color="" font_size="18" btn_text="Get Started" btn_color="#16d" btn_icon="" btn_url="/?page_id=2029" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
