(3145, 2197, 'waves_metabox_shortcode', '<div class="row-container dark bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/Blue-0070a2-bg.png);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Common Infrastructure Problems" weight="400" style="normal" position="center"]<strong>Our Health &amp; Safety Audit Identifies These and Other Common Problems in School Building Maintenance.</strong> “Improving a school’s ''Overall Compliance Rating’ to meet health and safety standards can lead to a 36-point increase in California Academic Performance Index score.”[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_team title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" team_title="<a href=/energy-efficient-windows>Outdated Windows</a>" position="" image="" facebook="" google="" twitter=""]<p>[tw_chart_circle size="waves-shortcode" chart_circle_pos="style_1" cc_type="text" cc_line_cap="round" cc_line_width="14" cc_text="80%" cc_percent="80" cc_size="150" cc_font_size="30" cc_font_color=" " cc_color="#0070a2" cc_track_color="#f5f5f5" cc_icon=" fa-star "]</p><p>80 percent of all inspections find <a href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/energy-efficient-windows/">Outdated Windows</a>.</p><p>&nbsp;</p><p>&nbsp; Changing all outdated single pane windows will help to increase total building efficiency. <a href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/energy-efficient-windows/">Dual-pane</a> Low-e windows will keep a space at the desired temperature for greater periods of time, allowing your <a href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/hvac-inefficiencies/">HVAC</a> to work less hard saving you money in the long run.</p>[/tw_team]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_team title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" team_title="<a href=/hvac-inefficiencies>HVAC Inefficiencies</a>" position="" image="" facebook="" google="" twitter=""]<p>[tw_chart_circle size="waves-shortcode" chart_circle_pos="style_1" cc_type="text" cc_line_cap="round" cc_line_width="14" cc_text="72%" cc_percent="72" cc_size="150" cc_font_size="30" cc_font_color=" " cc_color="#0070a2" cc_track_color="#f5f5f5" cc_icon=" fa-star "]</p><p>72 percent of all inspections find&nbsp;<a href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/hvac-inefficiencies/">HVAC Inefficiency</a> related&nbsp;issues.</p><p>&nbsp;</p><p>Sealing ducts and <a href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/hvac-inefficiencies/">HVAC</a> where needed with butyl tape and mastic for a secure seal eliminates the loss of conditioned air to undesired areas while improving while also improving the air quality of the space. Sealing leaks or replacing old units will result in reduced monthly charges.</p>[/tw_team]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_team title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" team_title="<a href=/gas-appliance-ventilation>Gas Appliance Ventilation</a>" position="" image="" facebook="" google="" twitter=""]<p>[tw_chart_circle size="waves-shortcode" chart_circle_pos="style_1" cc_type="text" cc_line_cap="round" cc_line_width="14" cc_text="34%" cc_percent="34" cc_size="150" cc_font_size="30" cc_font_color=" " cc_color="#0070a2" cc_track_color="#f5f5f5" cc_icon=" fa-star "]</p><p>34 percent of all inspections find <a href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/gas-appliance-ventilation/">Gas Appliance Ventilation</a> issues.&nbsp;</p><p>Gas burning appliances require proper air and <a href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/gas-appliance-ventilation/">ventilation</a> to burn and exhaust properly. Each appliance has specific requirements and operates differently. Improper air can cause flame back draft, inadequate combustion of fuel that can release excessive <a title="Carbon Monoxide Emmision" href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/carbon-monoxide-emmision/">carbon monoxide</a> and other emissions and improper exhaust of emissions. A physical assessment of the appliances and calculations are conducted to ensure these appliances are not being suffocated when burning gas.</p>[/tw_team]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_team title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" team_title="<a href=/gas-leaks>Gas Leaks</a>" position="" image="" facebook="" google="" twitter=""]<p>[tw_chart_circle size="waves-shortcode" chart_circle_pos="style_1" cc_type="text" cc_line_cap="round" cc_line_width="14" cc_text="50%" cc_percent="50" cc_size="150" cc_font_size="30" cc_font_color=" " cc_color="#0070a2" cc_track_color="#f5f5f5" cc_icon=" fa-star "]<br />50 percent of all inspections find&nbsp;<a href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/gas-leaks/">Gas Leak</a>&nbsp;issues.</p><p>Gas supply lines are tested using two levels of detection: “sniff and spray” and an electronic “gas sniffer.” <a href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/gas-leaks/">Leaks</a> are assessed at connections to gas burning appliances (such as furnaces, water heaters and kitchen appliances). Gas will have a unique smell and will cause bubbles when sprayed with a special solution. These leaks are further verified with the electronic “gas sniffer” before it is reported to the LEA for immediate attention. It is advised the LEA report the leak to its respective utility provider and remedy the leaks as quickly as possible.</p>[/tw_team]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_team title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" team_title="<a href=/lead-paint>Lead Paint</a>" position="" image="" facebook="" google="" twitter=""]<p>[tw_chart_circle size="waves-shortcode" chart_circle_pos="style_1" cc_type="text" cc_line_cap="round" cc_line_width="14" cc_text="67%" cc_percent="67" cc_size="150" cc_font_size="30" cc_font_color=" " cc_color="#0070a2" cc_track_color="#f5f5f5" cc_icon=" fa-star "]</p><p>67 percent of all inspections find&nbsp;<a href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/lead-paint/">Lead Paint</a>&nbsp;issues.</p><p>&nbsp;</p><p><a href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/lead-paint/">Lead Paint</a> – Buildings constructed prior to 1978 may contain paint with lead additives. Lead was used to decrease drying times, increase durability and maintain a fresh appearance. Common areas of concern are windows, doors and railings. Unless otherwise disclosed, the LEA will always be cautioned and recommended to conduct lead testing on buildings built prior to 1978.</p>[/tw_team]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_team title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" team_title="<a href=/carbon-monoxide-emmision>Carbon Monoxide Emission Levels</a>" position="" image="" facebook="" google="" twitter=""]<p>[tw_chart_circle size="waves-shortcode" chart_circle_pos="style_1" cc_type="text" cc_line_cap="round" cc_line_width="14" cc_text="30%" cc_percent="30" cc_size="150" cc_font_size="30" cc_font_color=" " cc_color="#0070a2" cc_track_color="#f5f5f5" cc_icon=" fa-star "]</p><p>30 percent of all inspections find&nbsp;fixable <a title="Carbon Monoxide Emmision" href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/carbon-monoxide-emmision/">Carbon Monoxide</a>&nbsp;issues.</p><p>&nbsp;</p><p><a title="Carbon Monoxide Emmision" href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/carbon-monoxide-emmision/">Carbon Monoxide</a> levels are tested for at gas burning appliances. Each appliance emits Carbon Monoxide, however appliances that are working improperly will produce higher levels. LEAs should consider repairing or replacing these appliances when Carbon Monoxide levels exceed BPI standards.</p>[/tw_team]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_team title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" team_title="<a href=/moisture-and-mold>Moisture & Mold</a>" position="" image="" facebook="" google="" twitter=""]<p>[tw_chart_circle size="waves-shortcode" chart_circle_pos="style_1" cc_type="text" cc_line_cap="round" cc_line_width="14" cc_text="36%" cc_percent="36" cc_size="150" cc_font_size="30" cc_font_color=" " cc_color="#0070a2" cc_track_color="#f5f5f5" cc_icon=" fa-star "]</p><p>36 percent of all inspections find&nbsp;untreated <a title="Moisture and Mold" href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/moisture-and-mold/">Moisture and Mold</a>&nbsp;issues.</p><p>&nbsp;</p><p>A fungus that travels through air and thrives in humid (>50%), moisture-rich areas that can lead to respiratory health problems, including <a title="Moisture and Mold" href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/moisture-and-mold/">asthma</a> in humans. Common areas for mold are attics, bathrooms, kitchen, crawlspaces and basements where water can gather, pool and travel. <a title="Moisture and Mold" href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/moisture-and-mold/">Mold</a> is an indication of roof leaks, indoor plumbing problems and flooding. The proper way to clean mold is to use detergent solutions that physically remove it, however for significant mold growth a mold remediation professional may be necessary.</p>[/tw_team]</div>[/tw_layout][tw_layout bg_type="" size="col-md-6" layout_custom_class=""]<div class="row">[tw_team title="" size="col-md-12" class="" layout_size="col-md-6" row_type="row" animation="fadeIn" animation_delay="" team_title="<a href=/asbestos>Asbestos</a>" position="" image="" facebook="" google="" twitter=""]<p>[tw_chart_circle size="waves-shortcode" chart_circle_pos="style_1" cc_type="text" cc_line_cap="round" cc_line_width="14" cc_text="60%" cc_percent="60" cc_size="150" cc_font_size="30" cc_font_color=" " cc_color="#0070a2" cc_track_color="#f5f5f5" cc_icon=" fa-star "]</p><p>60 percent of all inspections of buildings built prior to 1975 find&nbsp;untreated <a title="Asbestos" href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/asbestos/">Asbestos</a> related&nbsp;issues.</p><p>A common material used prior to 1975 for school buildings as sound mitigation and resistance to fire, heat, electrical and chemical damage. The United States has not completely banned its use, but does warn of its toxicity to humans when airborne. To fully verify its presence fibers are analyzed under microscopy. Our assessment is visual and based on our extensive experience in building materials. LEAs should be aware of possible asbestos in its buildings when renovating and modernizing its facilities.</p>[/tw_team]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/solar-parallaxq.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" text="People Choose Highlands For Our Free Comprehensive Efficiency And Safety Audit" bg_color=" " font_size="18" btn_text="Get Started" btn_color="#176734" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
