(4007, 2292, 'waves_metabox_shortcode', '<div class="row-container dark bg-scroll" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/Blue-0070a2-bg.png);"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Window Replacement" weight="400" style="normal" position="center"]There are two parts to energy efficient windows; Dual panes and Low-e coatings. Replacing your outdated windows can lead to large energy savings and increased comfort.[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="Dual%20Panes" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Dual pane, or double pane windows consist of two panes of glass, with an air or gas filled chamber in between. This chamber insulates and acts as a buffer against temperature changes, as well as noise pollution.<br /><a href="http://henergy.staging.wpengine.com/wp-content/uploads/2014/10/dual-paned-glass.jpg"><img class="size-medium wp-image-2300 aligncenter" src="http://henergy.staging.wpengine.com/wp-content/uploads/2014/10/dual-paned-glass-286x300.jpg" alt="Dual Paned Window" width="286" height="300" /></a></p>[/tw_column][tw_column title="Low-E" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Low-E coated glass panes block out infrared light in order to keep the heat out during summer as well as to keep the warmth in during winter. This Low-E coating also blocks harmful UV rays, which can cause interior furniture and carpet to fade.</p><p><a href="http://henergy.staging.wpengine.com/wp-content/uploads/2014/10/UVlight.jpg"><img class="size-medium wp-image-2301 aligncenter" src="http://henergy.staging.wpengine.com/wp-content/uploads/2014/10/UVlight-300x200.jpg" alt="Ultraviolet Light" width="300" height="200" /></a></p>[/tw_column]</div><div class="row">[tw_column title="How%20you%20should%20consider%20window%20replacement%3A" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Replacing old windows with energy efficient windows can cut heat loss in half, reducing your energy costs. They also increase overall comfort in your building, by reducing hot and cold spots within rooms and by reducing distracting outside noise. We offer complete retrofitting, including window replacement, which can lead to large energy savings, and create a healthier and more comfortable environment. <a title="Contact" href="http://henergy.staging.wpengine.com/contact-2/">Contact us</a> today to request an energy audit.</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.staging.wpengine.com/wp-content/uploads/2014/07/solar-parallax2.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" text="People Choose Highlands For Our Free Comprehensive Efficiency And Safety Audit" bg_color=" " font_size="18" btn_text="Get Started" btn_color="#16d1ac" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_blank"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
