B%22column_content%22%3A%22%253Cp%253EUncleaned%2520or%2520old%2520air%2520filters%2520can%2520drastically%2520reduce%2520the%2520efficiency%2520of%2520your%2520HVAC.%2520By%2520keeping%2520things%2520routinely%2520maintained%252C%2520energy%2520efficiency%2520can%2520be%2520increased%2520by%2520up%2520to%252015%2525.%2520Similarly%252C%2520old%2520and%2520out-of-date%2520systems%2520simply%2520aren''t%2520as%2520energy%2520efficient%2520as%2520newer%2520models%252C%2520and%2520may%2520need%2520to%2520be%2520replaced.%253C%252Fp%253E%22%7D%7D%7D%7D%2C%222%22%3A%7B%22size%22%3A%22col-md-0%22%2C%22items%22%3A%7B%7D%7D%7D%7D%2C%222%22%3A%7B%22row_custom_class%22%3A%22%22%2C%22row_custom_id%22%3A%22%22%2C%22background_color%22%3A%22%22%2C%22background_image%22%3A%22http%3A%2F%2Fhenergy.staging.wpengine.com%2Fwp-content%2Fuploads%2F2014%2F07%2Fsolar-parallax2.jpg%22%2C%22add_background_image%22%3A%22Upload%22%2C%22background_style%22%3A%22parallax%22%2C%22background_video%22%3A%22%22%2C%22add_background_video%22%3A%22Upload%22%2C%22default_row%22%3A%22false%22%2C%22row_layout%22%3A%22full%22%2C%22row_contrast%22%3A%22light%22%2C%22padding_top%22%3A%22%22%2C%22padding_bottom%22%3A%22%22%2C%22layouts%22%3A%7B%220%22%3A%7B%22size%22%3A%22col-md-0%22%2C%22items%22%3A%7B%7D%7D%2C%221%22%3A%7B%22size%22%3A%22col-md-12%22%2C%22items%22%3A%7B%220%22%3A%7B%22slug%22%3A%22callout%22%2C%22size%22%3A%22col-md-12%22%2C%22item_title%22%3A%22%22%2C%22custom_class%22%3A%22%22%2C%22animation%22%3A%22none%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22text%22%3A%22People%2520Choose%2520Highlands%2520For%2520Our%2520Free%2520Comprehensive%2520Efficiency%2520And%2520Safety%2520Audit%22%2C%22bg_color%22%3A%22%2520%22%2C%22font_size%22%3A%2218%22%2C%22btn_text%22%3A%22Get%2520Started%22%2C%22btn_color%22%3A%22%252316d1ac%22%2C%22btn_icon%22%3A%22%22%2C%22btn_url%22%3A%22http%253A%252F%252Fhenergy.wpengine.com%252F%253Fpage_id%253D1674%22%2C%22btn_target%22%3A%22_blank%22%7D%7D%7