(4018, 2295, 'waves_metabox_shortcode', '<div class="row-container dark bg-scroll" style="background-color:#0070a2;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="HVAC Inefficiencies" weight="400" style="normal" position="center"]Common problems for HVAC units[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="Unsealed%20vents%20and%20air%20ducts" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>A leaking vent or duct can cause heated or cooled air to make its way outside, instead of indoors as intended. Ensuring that all vents and ducts are properly sealed with butyl tape or mastic will drastically improve energy efficiency.</p>[/tw_column]</div><div class="row">[tw_column title="Manual%20Thermostats" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>&nbsp;Many people make the mistake of setting a manual thermostat lower than the ideal temperature, believing that this will cool the room faster. This however is not the case, and can cause your HVAC to work harder and longer than necessary. Additionally, the mistake can be made when a building is set to be cooled or heated when nobody is there to use it, such as overnight or during weekends. Programmable thermostats can eliminate this problem with timers that will automatically adjust temperatures so energy is only being used when you need it.</p>[/tw_column]</div><div class="row">[tw_column title="Improper%20Maitenence" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Uncleaned or old air filters can drastically reduce the efficiency of your HVAC. By keeping things routinely maintained, energy efficiency can be increased by up to 15%. Similarly, old and out-of-date systems simply aren''t as energy efficient as newer models, and may need to be replaced.</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.staging.wpengine.com/wp-content/uploads/2014/07/solar-parallax2.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" text="People Choose Highlands For Our Free Comprehensive Efficiency And Safety Audit" bg_color=" " font_size="18" btn_text="Get Started" btn_color="#16d1ac" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_blank"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
