(4025, 2296, 'waves_metabox_shortcode', '<div class="row-container dark bg-scroll" style="background-image:url(http://henergy.wpengine.com/wp-content/uploads/2014/07/Blue-0070a2-bg.png);"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Gas Appliance Ventilation" weight="400" style="normal" position="center"]Risks and hazards associated with improper ventilation[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="Carbon%20Monoxide" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Improperly ventilated gas appliances can potentially leak CO, the result of incompletely burned fuel. Because CO is colorless and odorless, this hazard can easily go unnoticed until a gas leak test is performed or, in worse case scenarios, an illness or death occurs.</p>[/tw_column]</div><div class="row">[tw_column title="Fire%20Hazards" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Leaking, damaged, or improper ventilation on gas appliances can pose a large fire hazard, especially in any case where leaking gas may come into contact with an open flame, such as a pilot light. Ensuring that all gas appliances are properly ventilated and maintained will help to prevent any unnecessary risks.</p>[/tw_column]</div><div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeInUp" animation_delay="" text="Testing for gas leaks can prevent unnecessary risks." bg_color="#fcb712" font_size="18" btn_text="Learn More" btn_color="#176734" btn_icon="" btn_url="http://henergy.staging.wpengine.com/prop-39-schools/gas-leaks/" btn_target="_self"][/tw_callout]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.staging.wpengine.com/wp-content/uploads/2014/07/solar-parallax2.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" text="People Choose Highlands For Our Free Comprehensive Efficiency And Safety Audit" bg_color=" " font_size="18" btn_text="Get Started" btn_color="#16d1ac" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_blank"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
