(4032, 2299, 'waves_metabox_shortcode', '<div class="row-container dark bg-scroll" style="background-color:#0070a2;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Detecting Gas Leaks" weight="400" style="normal" position="center"]Eliminate a serious health hazard by testing for gas leaks[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="%22Sniff%20and%20Spray%22%20Detection" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>While gas leaks are typically colorless and odorless, spraying a special solution onto common leak point will cause otherwise undetectable leaks to become apparent. If a leak is present, bubbles will form where gas is escaping, and the addition of the solution to the gas will cause it to give off a noticeable odor. An electronic sniffer will then further verify the presence of a gas leak.</p>[/tw_column][tw_column title="Electronic%20Gas%20Sniffers" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>While the "Sniff and Spray" technique provides an initial notification for a potential leak, an electronic gas sniffer can fully verify the potential issue. They can identify the type of gas being leaked as well as the concentration of the gas in PPM (parts per million). A gas leak can be a serious health hazard, and as such require immediate attention if detected.</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.staging.wpengine.com/wp-content/uploads/2014/07/solar-parallax2.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" text="People Choose Highlands For Our Free Comprehensive Efficiency And Safety Audit" bg_color=" " font_size="18" btn_text="Get Started" btn_color="#16d1ac" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_blank"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
