s%22%3A%7B%22column_content%22%3A%22%253Cp%253ELead%2520was%2520a%2520common%2520additive%2520to%2520paint%2520up%2520until%2520the%2520late%25201970s.%2520It%2520was%2520added%2520to%2520quicken%2520the%2520drying%2520process%252C%2520repel%2520moisture%252C%2520and%2520increase%2520durability.%2520However%252C%2520lead%2520has%2520since%2520been%2520found%2520to%2520be%2520a%2520hazardous%2520material%252C%2520and%2520can%2520cause%2520many%2520illnesses%252C%2520including%2520nervous%2520system%2520damage%252C%2520kidney%2520growth%252C%2520reproductive%2520issues%252C%2520amongst%2520other%2520health%2520concerns.%2520If%2520a%2520building%2520is%2520found%2520to%2520have%2520lead%2520paint%252C%2520steps%2520must%2520be%2520taken%2520to%2520ensure%2520proper%2520removal.%253C%252Fp%253E%22%7D%7D%2C%221%22%3A%7B%22slug%22%3A%22column%22%2C%22size%22%3A%22col-md-4%22%2C%22item_title%22%3A%22Safety%2520Concerns%22%2C%22custom_class%22%3A%22%22%2C%22animation%22%3A%22none%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22column_content%22%3A%22%253Cp%253EImproper%2520removal%2520of%2520lead%2520paint%2520can%2520sometimes%2520worsen%2520the%2520situation%2520if%2520certain%2520precautions%2520are%2520not%2520taken.%2520Done%2520wrong%252C%2520lead%2520paint%2520removal%2520can%2520cause%2520hazardous%2520lead%2520dust%2520to%2520fill%2520the%2520air%252C%2520damaging%2520the%2520respiratory%2520system.%2520Therefore%252C%2520the%2520removal%2520of%2520lead%2520paint%2520is%2520best%2520left%2520to%2520trained%2520professionals.%253C%252Fp%253E%22%7D%7D%7D%7D%2C%222%22%3A%7B%22size%22%3A%22col-md-0%22%2C%22items%22%3A%7B%7D%7D%7D%7D%2C%222%22%3A%7B%22row_custom_class%22%3A%22%22%2C%22row_custom_id%22%3A%22%22%2C%22background_color%22%3A%22%230070a2%22%2C%22background_image%22%3A%22http%3A%2F%2Fhenergy.staging.wpengine.com%2Fwp-content%2Fuploads%2F2014%2F07%2Fsolar-parallax2.jpg%22%2C%22add_background_image%22%3A%22Upload%22%2C%22background_style%22%3A%22parallax%22%2C%22background_video%22%3A%22%22%2C%22add_background_video%22%3A%22Upload%22%2C%22default_row%22%3A%22false%22%2C%22row_layout%22%3A%22full%22%2C%22row_contrast%22%3A%22light%22%2C%22padding_top%22%3A%22%22%2C%22padding_bottom%22%3A%22%22%2C%22layouts%22%3A%7B%220%22%3A%7B%22size%22%3A%22col-md-0%22%2C%22items%22%3A%7B%7D%7D%2C%221%22%3A%7B%22size%22%3A%22col-md-12%22%2C%22items%22%3A%7B%220%22%3A%7B%22slug%22%3A%22callout%22%2C%22size%22%3A%22col-md-12%22%2C%22item_title%22%3A%22%22%2C%22custom_class%22%3A%22%22%2C%22animation%22%3A%22none%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22text%22%3A%22People%2520Choose%2520Highlands%2520For%2520Our%2520Free%2520Comprehensive%2520Efficiency%2520And%2520Safety%2520Audit%22%2C%22bg_color%22%3A%22%22%2C%22font_size%22%3A%2218%22%2C%22btn_text%22%3A%22Get%2520Started%22%2C%22btn_color%22%3A%22%252316d1ac%22%2C%22btn_icon%22%3A%22%22%2C%22btn_url%22%3A%22http%253A%252F%252Fhenergy.wpengine.com%252F%253Fpage_id%253D1674%22%2C%22btn_target%22%3A%22_blank%22%7D%7D%7D%7D%2C%222%22%3A%7B%22size%22%3A%22col-md-0%22%2C%22items%22%3A%7B%7D%7D%7D%7D%7D'),
(4045, 2302, 'waves_metabox_shortcode', '<div class="row-container dark bg-scroll" style="background-color:#0070a2;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Lead Paint" weight="400" style="normal" position="center"]Health and Safety Risks[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="About%20Lead" size="col-md-8" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Lead was a common additive to paint up until the late 1970s. It was added to quicken the drying process, repel moisture, and increase durability. However, lead has since been found to be a hazardous material, and can cause many illnesses, including nervous system damage, kidney growth, reproductive issues, amongst other health concerns. If a building is found to have lead paint, steps must be taken to ensure proper removal.</p>[/tw_column][tw_column title="Safety%20Concerns" size="col-md-4" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Improper removal of lead paint can sometimes worsen the situation if certain precautions are not taken. Done wrong, lead paint removal can cause hazardous lead dust to fill the air, damaging the respiratory system. Therefore, the removal of lead paint is best left to trained professionals.</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-color:#0070a2;background-image:url(http://henergy.staging.wpengine.com/wp-content/uploads/2014/07/solar-parallax2.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" text="People Choose Highlands For Our Free Comprehensive Efficiency And Safety Audit" bg_color="" font_size="18" btn_text="Get Started" btn_color="#16d1ac" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_blank"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
