(4178, 2313, 'waves_metabox_shortcode', '<div class="row-container dark bg-scroll" style="background-color:#0070a2;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Carbon Monoxide Emission" weight="400" style="normal" position="center"]Ensure that appliances are emitting safe levels of Carbon Monoxide[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-4" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p><a href="http://henergy.staging.wpengine.com/wp-content/uploads/2014/10/gasappliance.jpg"><img class="size-medium wp-image-2314 aligncenter" src="http://henergy.staging.wpengine.com/wp-content/uploads/2014/10/gasappliance-300x200.jpg" alt="Gas Stove" width="300" height="200" /></a></p>[/tw_column][tw_column title="" size="col-md-8" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Carbon Monoxide is emitted from practically all gas or fuel burning appliances, and the emission is not just limited to <a title="Gas Leaks" href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/gas-leaks/">gas leaks</a> or <a title="Gas Appliance Ventilation" href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/gas-appliance-ventilation/">improper ventilation</a>. Old or improperly functioning appliances will emit higher levels of CO when fuel is not being efficiently burned. Routine checks are needed to ensure that Carbon Monoxide emissions stay within safe levels.</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.staging.wpengine.com/wp-content/uploads/2014/07/solar-parallax2.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" text="People Choose Highlands For Our Free Comprehensive Efficiency And Safety Audit" bg_color=" " font_size="18" btn_text="Get Started" btn_color="#16d1ac" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_blank"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
