(4202, 2316, 'waves_metabox_shortcode', '<div class="row-container dark bg-scroll" style="background-color:#0070a2;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Moisture and Mold" weight="400" style="normal" position="center"]Leaks from roofing and improper plumbing can cause harmful mold and mildew to build up[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="Mold" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Mold is a fungi that grows in moist environments and can be the result of leaks or other moisture problems. Over time, mold can cause structural damage to walls, insulation, and other parts of your building. In addition, exposure to mold can cause multiple heath issues, such as respiratory illness, allergic reactions, asthma attacks, fatigue, and migraines.</p>[/tw_column][tw_column title="Mildew" size="col-md-6" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Mildew is a specific type of mold which, although causing fewer health issues and less damaging to building structure, is still a serious problem which should be taken care of. Inhalation of mildew spores can cause coughing, sore throats, headaches, and other complications.</p>[/tw_column]</div><div class="row">[tw_column title="Don''t%20just%20surface%20clean" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>While cleaning and scrubbing away mold and mildew can remove most of the respiratory health risks, it is more important to identify and remove the cause of the moisture in order to protect building structure and prevent further mold growth.</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.staging.wpengine.com/wp-content/uploads/2014/07/solar-parallax2.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" text="People Choose Highlands For Our Free Comprehensive Efficiency And Safety Audit" bg_color=" " font_size="18" btn_text="Get Started" btn_color="#16d1ac" btn_icon="" btn_url="http://henergy.wpengine.com/?page_id=1674" btn_target="_blank"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
