lass%22%3A%22%22%2C%22animation%22%3A%22none%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22column_content%22%3A%22%253Cp%253EAsbestos%2520is%2520a%2520group%2520of%2520naturally%2520occurring%2520silicate%2520compounds.%2520Composed%2520of%2520long%252C%2520thin%2520fibers%252C%2520asbestos%2520was%2520once%2520highly%2520sought%2520after%2520as%2520a%2520building%2520material%2520due%2520to%2520its%2520resilience%2520and%2520insulating%2520properties.%2520Many%2520buildings%2520constructed%2520before%25201980%2520will%2520contain%2520asbestos.%253C%252Fp%253E%22%7D%7D%2C%221%22%3A%7B%22slug%22%3A%22column%22%2C%22size%22%3A%22col-md-12%22%2C%22item_title%22%3A%22Health%2520Risks%22%2C%22custom_class%22%3A%22%22%2C%22animation%22%3A%22none%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22column_content%22%3A%22%253Cp%253EExposure%2520to%2520asbestos%2520fibers%2520is%2520known%2520to%2520be%2520linked%2520to%2520many%2520health%2520risks.%2520In%2520the%2520case%2520of%2520building%2520materials%252C%2520it%2520can%2520take%2520very%2520little%2520wear%2520and%2520tear%2520for%2520asbestos%2520fibers%2520to%2520become%2520airborne%252C%2520entering%2520the%2520respiratory%2520system%2520or%2520attaching%2520onto%2520skin%2520or%2520clothing.%2520An%2520second%2520hand%2520risk%2520comes%2520up%2520when%2520a%2520person%2520in%2520contact%2520with%2520asbestos%2520then%2520returns%2520home%252C%2520as%2520fibers%2520clinging%2520to%2520the%2520body%2520can%2520become%2520airborne%252C%2520affecting%2520those%2520at%2520home.%253C%252Fp%253E%253Cp%253EThe%2520most%2520well%2520known%2520illnesses%2520associated%2520with%2520asbestos%2520exposure%2520is%2520asbestosis%252C%2520a%2520chronic%2520lung%2520disease%2520that%2520causes%2520scarring%2520of%2520the%2520lung%2520tissue%252C%2520and%2520mesothelioma%2520lung%2520cancer.%253C%252Fp%253E%22%7D%7D%2C%222%22%3A%7B%22slug%22%3A%22column%22%2C%22size%22%3A%22col-md-12%22%2C%22item_title%22%3A%22Asbestos%2520in%2520Schools%22%2C%22custom_class%22%3A%22%22%2C%22animation%22%3A%22none%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22column_content%22%3A%22%253Cp%253EUnless%2520a%2520school%2520is%2520newly%2520built%252C%2520chances%2520are%2520it%2520will%2520contain%2520some%2520form%2520of%2520asbestos%252C%2520typically%2520in%2520the%2520insulation.%252050%2525%2520of%2520school%2520buildings%2520currently%2520in%2520use%2520in%2520the%2520United%2520state%2520were%2520constructed%2520between%25201950%2520and%25201970%252C%2520which%2520were%2520peak%2520years%2520for%2520asbestos%2520usage.%2520Due%2520to%2520the%2520high%2520health%2520risks%2520associated%2520with%2520asbestos%252C%2520it%2520is%2520necessary%2520that%2520older%2520buildings%2520be%2520regularly%2520inspected%2520for%2520asbestos.%253C%252Fp%253E%22%7D%7D%7D%7D%2C%222%22%3A%7B%22size%22%3A%22col-md-0%22%2C%22items%22%3A%7B%7D%7D%7D%7D%2C%222%22%3A%7B%22row_custom_class%22%3A%22%22%2C%22row_custom_id%22%3A%22%22%2C%22background_color%22%3A%22%20%22%2C%22background_image%22%3A%22http%3A%2F%2Fhenergy.staging.wpengine.com%2Fwp-content%2Fuploads%2F2014%2F07%2Fsolar-parallax2.jpg%22%2C%22add_background_image%22%3A%22Upload%22%2C%22background_style%22%3A%22parallax%22%2C%22background_video%22%3A%22%22%2C%22add_background_video%22%3A%22Upload%22%2C%22default_row%22%3A%22false%22%2C%22row_layout%22%3A%22full%22%2C%22row_contrast%22%3A%22light%22%2C%22padding_top%22%3A%22%22%2C%22padding_bottom%22%3A%22%22%2C%22layouts%22%3A%7B%220%22%3A%7B%22size%22%3A%22col-md-0%22%2C%22items%22%3A%7B%7D%7D%2C%221%22%3A%7B%22size%22%3A%22col-md-12%22%2C%22items%22%3A%7B%220%22%3A%7B%22slug%22%3A%22callout%22%2C%22size%22%3A%22col-md-12%22%2C%22item_title%22%3A%22%22%2C%22custom_class%22%3A%22%22%2C%22animation%22%3A%22none%22%2C%22animation_delay%22%3A%22%22%2C%22settings%22%3A%7B%22text%22%3A%22People%2520Choose%2520Highlands%2520For%2520Our%2520Free%2520Comprehensive%2520Efficiency%2520And%2520Safety%2520Audit%22%2C%22bg_color%22%3A%22%2520%22%2C%22font_size%22%3A%2218%22%2C%22btn_text%22%3A%22Get%2520Started%22%2C%22btn_color%22%3A%22%252316d1ac%22%2C%22btn_icon%22%3A%22%22%2C%22btn_url%22%3A%22%2523%22%2C%22btn_target%22%3A%22_blank%22%7D%7D%7D%7D%2C%222%22%3A%7B%22size%22%3A%22col-md-0%22%2C%22items%22%3A%7B%7D%7D%7D%7D%7D'),
(4221, 2318, 'waves_metabox_shortcode', '<div class="row-container dark bg-scroll" style="background-color:#0070a2;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_heading title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="fadeIn" animation_delay="" text="Asbestos" weight="400" style="normal" position="center"]A once common insulating material, Asbestos has many serious health risks.[/tw_heading]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="What%20is%20Asbestos%3F" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Asbestos is a group of naturally occurring silicate compounds. Composed of long, thin fibers, asbestos was once highly sought after as a building material due to its resilience and insulating properties. Many buildings constructed before 1980 will contain asbestos.</p>[/tw_column]</div><div class="row">[tw_column title="Health%20Risks" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Exposure to asbestos fibers is known to be linked to many health risks. In the case of building materials, it can take very little wear and tear for asbestos fibers to become airborne, entering the respiratory system or attaching onto skin or clothing. An second hand risk comes up when a person in contact with asbestos then returns home, as fibers clinging to the body can become airborne, affecting those at home.</p><p>The most well known illnesses associated with asbestos exposure is asbestosis, a chronic lung disease that causes scarring of the lung tissue, and mesothelioma lung cancer.</p>[/tw_column]</div><div class="row">[tw_column title="Asbestos%20in%20Schools" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p>Unless a school is newly built, chances are it will contain some form of asbestos, typically in the insulation. 50% of school buildings currently in use in the United state were constructed between 1950 and 1970, which were peak years for asbestos usage. Due to the high health risks associated with asbestos, it is necessary that older buildings be regularly inspected for asbestos.</p>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-parallax" style="background-image:url(http://henergy.staging.wpengine.com/wp-content/uploads/2014/07/solar-parallax2.jpg);"><div class="container"><div class="row">[tw_layout bg_type="parallax" size="col-md-12" layout_custom_class=""]<div class="row">[tw_callout title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" text="People Choose Highlands For Our Free Comprehensive Efficiency And Safety Audit" bg_color=" " font_size="18" btn_text="Get Started" btn_color="#16d1ac" btn_icon="" btn_url="#" btn_target="_blank"][/tw_callout]</div>[/tw_layout]</div></div></div>'),
