(4411, 2349, 'waves_metabox_shortcode', '<div id="fauxheader" class="row-container dark bg-scroll fauxheader" style="background-color:#17ade5;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-12" class="fauxheader" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<div class="blockheader"><img class="alignright size-full wp-image-2381 esapimg" src="http://henergy.staging.wpengine.com/wp-content/uploads/2015/06/Energy-Savings-Assistance-Program.jpg" alt="Energy Savings Assistance Program" height="100%" /><span class="freeprogram">FREE PROGRAM</span><br /><span class="freeprogrames">PROGRAMA GRATUITO</span></div>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_tab title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay="" position="top"][tw_tab_item title="English" title_icon="fa-star"]<p><img class="aligncenter size-full wp-image-2376 esapslide" src="http://henergy.staging.wpengine.com/wp-content/uploads/2015/05/esap-home-improvements-1.jpg" alt="esap-home-improvements-1" width="80%" /></p><p class="aboutesap" style="text-align: center; font-size: 24px; color: #000;">Your electric and gas company’s Energy Savings Assistance Program provides qualified <strong><u>renters</u></strong><sup style="font-size: 14px;">*</sup> and <strong><u>homeowners</u></strong><sup style="font-size: 14px;">**</sup> with home improvements that can save you 20-35% a month on your bill at no cost to you!</p><p class="aboutesap" style="text-align: center; color: #000; font-size: 30px; font-weight: 300;">See if you qualify now!</p><p>[gravityform id="1" title="false" description="false" ajax="true"] <img class="aligncenter size-full wp-image-2376 esapslide" src="http://henergy.staging.wpengine.com/wp-content/uploads/2015/05/esap-home-improvements-2.jpg" alt="esap-home-improvements-2" width="80%" /></p>[/tw_tab_item][tw_tab_item title="Español" title_icon="fa-star"]<p><img class="aligncenter size-full wp-image-2376 esapslide" src="http://henergy.staging.wpengine.com/wp-content/uploads/2015/06/esap-home-improvements-1es.png" alt="esap-home-improvements-1es" width="80%" /></p><p class="aboutesap" style="text-align: center; font-size: 24px; color: #000;">¡El Programa de Asistencia de Ahorrar Energía de su compañiía de electricidad y gas podria proporcionar a <strong><u>inquilinos</u></strong><sup style="font-size: 14px;">*</sup> o <strong><u>propietarios calificados</u></strong><sup style="font-size: 14px;">**</sup> para hacer reformas en el hogar que le pueden ahorrar un 20-35% al mes en su factura, sin costo para usted!</p><p class="aboutesap" style="text-align: center; color: #000; font-size: 30px; font-weight: 300;">¡Cheque si califica ahora!</p><p>[gravityform id="2" title="false" description="false" ajax="true"] <img class="aligncenter size-full wp-image-2376 esapslide" src="http://henergy.staging.wpengine.com/wp-content/uploads/2015/06/esap-home-improvements-2es.png" alt="esap-home-improvements-2es" width="80%" /></p>[/tw_tab_item][/tw_tab]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style="background-color:#17ade5;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-9" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p><span style="color: #fff;">*Renters need written permission from landlords to receive program services. <br /><small>*Los inquilinos necesitan el permiso por escrito de los propietarios para recibir los servicios del programa.</small> <br />**Homeowners may also be eligible to receive furnace and water heater repair or replacement services when existing natural gas units are deemed inoperable or hazardous. <br /><small>**Los propietarios también pueden ser elegibles para recibir servicios de hornos y reparación del calentador de agua o de reemplazo cuando las unidades de gas natural existentes son considerados inoperables o peligrosos.</small></span></p>[/tw_column][tw_column title="" size="col-md-3" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p><img class="aligncenter size-full wp-image-2386" src="http://henergy.staging.wpengine.com/wp-content/uploads/2015/05/HE_logoESAPauthorized.png" alt="HE_logoESAPauthorized" width="100%" /></p>[/tw_column]</div>[/tw_layout]</div></div></div>'),
