(4524, 2387, 'waves_metabox_shortcode', '<div id="fauxheader" class="row-container dark bg-scroll fauxheader" style="background-color:#17ade5;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-12" class="fauxheader" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<div class="blockheader"><img class="alignright size-full wp-image-2381 esapimg" src="http://henergy.staging.wpengine.com/wp-content/uploads/2015/06/Energy-Savings-Assistance-Program.jpg" alt="Energy Savings Assistance Program" height="100%" /><span class="freeprogram">FREE PROGRAM</span> <span class="freeprogrames">PROGRAMA GRATUITO</span></div>[/tw_column]</div>[/tw_layout]</div></div></div><div class="row-container light bg-scroll" style=""><div class="container"><div class="row"><div style="padding-top:20px"></div>[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-12" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p style="text-align: center;">You may qualify for the Energy Savings Assistance Program. <br />We will contact you within 24 hours during business hours Monday - Friday 9am - 6pm to continue your enrollment.</p>[/tw_column]</div>[/tw_layout]</div><div style="padding-bottom:20px"></div></div></div><div class="row-container light bg-scroll" style="background-color:#17ade5;"><div class="container"><div class="row">[tw_layout bg_type="" size="col-md-12" layout_custom_class=""]<div class="row">[tw_column title="" size="col-md-9" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p><span style="color: #fff;">*Renters need written permission from landlords to receive program services. <br /><small>*Los inquilinos necesitan el permiso por escrito de los propietarios para recibir los servicios del programa.</small> <br />**Homeowners may also be eligible to receive furnace and water heater repair or replacement services when existing natural gas units are deemed inoperable or hazardous. <br /><small>**Los propietarios también pueden ser elegibles para recibir servicios de hornos y reparación del calentador de agua o de reemplazo cuando las unidades de gas natural existentes son considerados inoperables o peligrosos.</small></span></p>[/tw_column][tw_column title="" size="col-md-3" class="" layout_size="col-md-12" row_type="row" animation="none" animation_delay=""]<p><img class="aligncenter size-full wp-image-2386" src="http://henergy.staging.wpengine.com/wp-content/uploads/2015/05/HE_logoESAPauthorized.png" alt="HE_logoESAPauthorized" width="100%" /></p>[/tw_column]</div>[/tw_layout]</div></div></div>'),
