(2237, 2, '2013-03-29 18:32:06', '2013-03-29 18:32:06', 'The <a href="http://www.highlandsenergy.net/">Alvarado Group</a> Chief Executive Officer Adam Avila was named to Business Street’s 40 Under 40, highlighting central California’s most successful and influential business professionals under the age of 40. Here is an excerpt from the <a href="http://businessstreetonline.com/40-under-40-adam-avila-the-alvarado-%20grouphighlands-energy-services/">BusinessStreetOnline.com</a> article “Avila joined <a href="http://www.highlandsenergy.net/">Highlands Energy</a> in 2008 as a project manager, and has turned the organization into a $3 million company since then.\r\n\r\nHe spends workdays developing more business for <a href="http://www.highlandsenergy.net/">Highlands Energy</a> and Vanguard Construction Services, doing research and providing direction. Avila works hard to develop the company’s culture. Avila spends much of his time away from work golfing, playing video games, and doing activities with his wife, Vanessa, and their 3-year-old son, Adam Josiah.”\r\n\r\nThere is also a video on the site in which Avila admits he is a bit “bashful” about being included in Business Street’s list. He also says if he was an animal he would be a donkey. “Donkeys just do their job,” Avila says with a smile. “They are reliable, and you can put an incredible burden on them and every day the donkey is just going to show up and he’s going to go to work and he’s going to carry the load. But donkeys can also be incredibly stubborn, so I think I would be most like a donkey.”\r\n\r\nThe 40 Under 40 Ultimate Networking Event, honoring Avila and the other 39 spotlighted business professionals, was held March 21, 2013.', 'Highlands Energy 40 Under 40', '', 'publish', 'closed', 'open', '', 'highlands-energy-40-under-40', '', '', '2014-09-11 20:17:08', '2014-09-11 20:17:08', '', 0, 'http://henergy.wpengine.com/?p=2237', 0, 'post', '', 0),
(2238, 2, '2014-01-06 18:34:58', '2014-01-06 18:34:58', 'Highlands Energy named Kenneth “Darrell” Wilson its Employee of the Year for 2013. Wilson, with HES since 2009, is the Quality Assurance Manager and will expand the same role into Highlands Energy Solutions.\r\n“I can truly say that Kenneth always has the best interests of the company in mind, each and every day,” HES VP of Operations Santiago Banda said. “When I think of Kenneth, the words honorable, respectful, upright and honest come to mind. He is a pillar of goodness in the ever challenging environment of the construction industry and the demographic that we\r\nserve.” Wilson is a respected team player who often seeks new ways to help our staff improve its skills and is always willing to recognize members for their hard work and quality performance. Wilson is also willing to think of innovative ways to help build team chemistry, which in turn leads to a higher quality of work. For these and many other reasons, Kenneth Wilson is the HES Employee of the Year.', 'Highlands Energy EYO', '', 'publish', 'closed', 'open', '', 'highlands-energy-eyo', '', '', '2014-07-22 18:52:47', '2014-07-22 18:52:47', '', 0, 'http://henergy.wpengine.com/?p=2238', 0, 'post', '', 0),
(2239, 2, '2014-06-11 18:37:08', '2014-06-11 18:37:08', '&nbsp;\r\n\r\nMadera Unified School District has selected Highlands Energy to handle one of California’s first Proposition 39 contracts, which allots the school district $212,000 for the California Clean Energy Jobs Act. Highlands Energy will survey over 1.7 million square feet of the district’s facilities to determine what improvements and repairs can be made in order for Madera Unified to achieve maximum energy savings. The audit is expected to be completed by October and submitted to the state for the release of the Prop 39 funds.\r\n\r\n“We are thrilled to have Highlands Energy as our partner for our Prop 39 process,” Madera Unified Director of Facilities Planning &amp; Construction Management Rosalind Cox said. “Highlands Energy’s thoroughness and their team approach in addressing our energy savings needs made them a perfect fit for Madera Unified.”\r\n\r\nProp 39, approved in November of 2012, is a five-year corporate tax to support energy efficiency and alternative energy projects at state school districts. The proposition projects to give schools $550 million per year starting in the 2013-14 school year.\r\nThe first phase of the Madera Unified contract is to conduct a thorough energy audit of the district’s facilities to identify potential energy and financial savings opportunities. Eventually an Energy Expenditure Plan will show a financial breakdown of proposed energy savings before the funds can be released. Energy improvements will also be evaluated for federal and state grants and bonds.\r\n\r\n“While Prop 39 offers a chance for schools to save a substantial amount of money on energy cost, our approach also looks at how improvements can significantly improve the learning environment for students,” Highlands Energy President Leonel Alvarado said. “We believe classrooms should be a safe and comfortable environment that fosters creativity, imagination and personal discovery. We help schools better control and reduce their energy bills so that financial resources can be reinvested back into the classrooms.”', 'Highlands Energy Working With Madera Schools', '', 'publish', 'closed', 'open', '', 'highlands-energy-working-with-madera-schools', '', '', '2014-09-11 20:15:48', '2014-09-11 20:15:48', '', 0, 'http://henergy.wpengine.com/?p=2239', 0, 'post', '', 0);
