(2246, 2, '2014-01-10 19:33:34', '2014-01-10 19:33:34', 'The Alvarado Group had the opportunity to participate in Coats for Kids. Just under 250 coats were distributed! Every winter, thousands of children go without a warm coat. This past holiday season, The Alvarado Group put focus on helping as many local children as possible.\r\n“We had several employees participate, however there are two that really stood out,” stated Consuelo Alvarado. These employees, Mark Keswick and Bill McComas, each shared about their experiences.\r\n“I have been helping with coat drives, anonymously, for about 5 years now. It was fun to finally be as involved as I was at the most recent coat drive with The Alvarado Group. It means even more because I am able to do this with my employer who are nice people and have generous hearts. I love being able to meet the parents and their children who are so grateful to receive the coats. It truly makes the hard work and efforts all worth it.” - Mark Keswick,\r\n“What a good thing it is to be in the position and wanting to help those who so desperately need some warmth and love. As a young child growing up in a farm labor atmosphere where money was scarce, what a joy it was to have a warm jacket. It warms our hearts to be able to give some of our time and see the joy of the children with their new coats and their parents appreciation of kindness and thoughtfulness of The Alvarado Group’s gifts. Mr. and Mrs. Alvarado, I thank you both for this!” - Bill McComas “Seeing the faces of these children when they received their new coats was unforgettable and well worth the time and effort of the occasion. Their little faces would simply light up and being involved in distribution of the coats was priceless,” states Consuelo. “I am hoping to see more employees bring forth volunteer efforts that are near and dear to their hearts so we can participate in even more of these types of events in 2014.”\r\nFor more information on getting involved in volunteer events, contact us!', 'Highlands Energy Volunteers', '', 'publish', 'closed', 'open', '', 'highlands-energy-volunteers', '', '', '2014-08-28 19:16:19', '2014-08-28 19:16:19', '', 0, 'http://henergy.wpengine.com/?p=2246', 0, 'post', '', 0),
