(2329, 7, '2015-01-15 00:10:56', '2015-01-15 00:10:56', 'More and more schools, businesses, and homeowners are turning to solar panels to increase their energy efficiency, reduce their energy costs, and take advantage of the tax incentives that come with installing <a title="Install Solar Panels" href="http://henergy.staging.wpengine.com/energy-efficiency/install-solar-panels/">solar panels</a>. California is currently leading the nation when it comes to harnessing solar energy, and now is the time to join the movement.\r\n\r\nIt is likely that you have found our page because your school has extra funding from California''s <a title="Prop 39 Schools" href="http://henergy.staging.wpengine.com/prop-39-schools/">Prop 39</a> to spend on increasing your school''s energy efficiency. We offer a complete energy efficiency audit that will take a look at the multiple factors that go into having an energy efficient building, including <a title="Window Replacement" href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/window-replacement/">outdated windows</a>, <a title="HVAC Inefficiencies" href="http://henergy.staging.wpengine.com/prop-39-schools/common-problem-areas/hvac-inefficiencies/">inefficient HVAC</a> units, and of course, whether your school is a good candidate for having <a href="http://henergy.staging.wpengine.com/energy-efficiency/install-solar-panels/" title="Install Solar Panels">solar panels</a> installed.\r\n\r\nMany school buildings have ample space on their roofs that is otherwise going unused, and this is one of the best places for <a href="http://henergy.staging.wpengine.com/energy-efficiency/install-solar-panels/" title="Install Solar Panels">solar panels</a> to be installed. When we complete our energy audit, we will determine whether your school has unused space for solar panels, find other areas where energy can be conserved, and give estimates and cost breakdowns, as well as ways for you to offset costs through grants, bonds, and your prop 39 funding.\r\n\r\n[tw_callout size="waves-shortcode" text="Schedule your energy efficiency audit today." bg_color=" " font_size="18" btn_text="Contact us" btn_color="#16d1ac" btn_icon="" btn_url="/energy-audit/" btn_target="_self"][/tw_callout]', 'Solar Panel Installation for California Schools', '', 'publish', 'open', 'open', '', 'solar-panel-installation-for-california-schools', '', '', '2015-04-01 21:47:53', '2015-04-01 21:47:53', '', 0, 'http://henergy.staging.wpengine.com/?p=2329', 0, 'post', '', 0),
(2333, 7, '2015-02-12 21:40:47', '2015-02-12 21:40:47', 'Submitting your Energy Expenditure Plan applications should soon get easier.\r\n\r\nAt the end of this month, the State of California will be launching a new online application system for LEAs and community colleges seeking Prop 39 funding. The state also plans to have training seminars in spring 2015 aimed to educate LEAs on how to use the new system. The application system will follow the newly approved <a title="Prop 39 Application Guidelines for 2015" href="www.energy.ca.gov/2014publications/CEC-400-2014-022/CEC-400-2014-022-CMF.pdf" target="_blank">2015 application guidelines</a>. This 70 page document covers application guidelines, eligibility information, as well as information on the award allocations available.\r\n\r\nWhen the new application system is launched, the Energy Commission will post revised program materials on the <a title="Prop 39 Official Site" href="http://www.energy.ca.gov/efficiency/proposition39/index.html" target="_blank">Prop 39 web page</a>. They will also send out Welcome emails to each LEA, informing them of the changes and inviting them to begin applying.\r\n\r\nAdditionally, the Energy Expenditure Plan Handbook and Energy Savings Calculator will be updated by the end of this month as well.\r\n\r\nFor more information please contact either <a href="mailto:prop39@energy.ca.gov">Prop39@energy.ca.gov</a> or call the Proposition 39 Hotline: 855-380-8722.', 'Coming Soon: New Online Application for Prop 39 LEAs', '', 'publish', 'open', 'open', '', 'coming-soon-new-online-application-for-prop-39-leas', '', '', '2015-02-12 21:54:50', '2015-02-12 21:54:50', '', 0, 'http://henergy.staging.wpengine.com/?p=2333', 0, 'post', '', 0),
(2335, 7, '2015-03-27 18:36:58', '2015-03-27 18:36:58', '<h2>Tips and Tricks to Help Reduce Your Energy Bill</h2>\r\n\r\nIt''s no secret that in the Central Valley, things get <em>hot</em>. It''s only march and yet we''ve already seen 90-degree weather. So in the summer, with the AC going, many residents find that their energy bills skyrocket. To help alleviate this problem, we''ve compiled a list of tips and tricks to help reduce your energy usage and keep costs down.\r\n\r\n<h3>Don''t just turn off unused appliances- unplug them</h3>\r\nThis tip is one of the most well known, and it can be extremely effective. If you aren''t currently using a device or charger, unplug it! Even when not in use, phone or other battery chargers, microwave, toaster, and other small small appliances combined can use as much energy daily as a refrigerator.\r\n\r\n<h3>Speaking of the Refrigerator...</h3>\r\nTake a look in your fridge and freezer. Is there a lot of frost? A buildup of frost can drastically reduce the efficiency of your units. Clean out that frost regularly, and don''t allow it to build up to more than 1/4 of an inch.\r\n\r\nAlso, fill your fridge up! It may seem counter-intuitive, but having your fridge packed full prevents it from warming up too fast when opening the door. This means it doesn''t have to work as hard to keep cool as you''re going in and out throughout the day.\r\n\r\nMake sure that you cover or wrap up foods or liquids left in your refrigerator. Uncovered items can release moisture, forcing your refrigerator''s compressor to work overtime to keep things dry and cool.\r\n\r\n<h3>Laundry</h3>\r\nBe sure to clean your lint trap after each and every load. Also, avoid running half-loads. Run full loads and, if your dryer has one, use the moisture-sensing setting. This can help save 5% on your energy bill.\r\n\r\n<h3>Make the Most of Grill Season</h3>\r\nIf possible, avoid using your oven during the hotter months. The heat generated forces your AC to work harder and longer to keep things cool. Try using a smaller toaster oven, a crock pot, stove top, or grill outdoors. If you do need to use your oven, try to limit your usage to the morning or evenings, when it is cooler outside.\r\n\r\n<h3>Beat the Heat</h3>\r\nDon''t just rely on your AC to keep things cool. Use your ceiling fans to create a cool breeze. If you raise your thermostat by only two degrees and use your ceiling fan, you can lower cooling costs by up to 14 percent. Keep your window coverings closed during the daytime to help block out heat from the sun. Before you head out for work, turn your thermostat up so your AC isn''t cooling an empty house.\r\n\r\nWant to learn more about how to reduce your energy costs? <a href="http://henergy.staging.wpengine.com/contact-2/" title="Contact">Contact us</a> or request an <a href="http://henergy.staging.wpengine.com/contact-2/energy-audit/" title="Request Audit">energy audit</a> to identify where your home or business could be saving energy.', 'Keep Cool and Cut Energy Costs', '', 'publish', 'open', 'open', '', 'keep-cool-and-cut-energy-costs', '', '', '2015-03-27 18:39:34', '2015-03-27 18:39:34', '', 0, 'http://henergy.staging.wpengine.com/?p=2335', 0, 'post', '', 0),
(2336, 7, '2015-04-01 21:42:15', '2015-04-01 21:42:15', '<h3>2014 was a great year for Solar Panels in California, and it''s predicted that 2015 will be even better.</h3>\r\n\r\nLast year, more than 6,200 MWh of traditional solar capacity was created in the United States- enough energy to power more than one million homes. The State of California was responsible for more than half of that growth, with about 3,550 MWh of capacity installed, according to a report by GTM Research and the Solar Energy Industries Association.\r\n\r\nAs recently announced by the U.S. Energy Information Administration (EIA), California now ranks 1st in the country for installed solar capacity, with a total capacity of 9,977 MWh currently installed. There is now enough solar energy installed in the state to power over 2.4 million homes. This makes California the first state in the nation to generate more than 5% of its electricity from solar power.\r\n\r\nThe Solar Foundation reported that the solar industry employed nearly 55,000 people in California in 2014. A separate report from the AEE projects that the number of people employed by advanced energy companies is expected to increase 17% in this coming year.\r\n\r\n[tw_callout size="waves-shortcode" text="Find out how you can cut costs by installing solar panels." bg_color=" " font_size="18" btn_text="Learn More" btn_color="#16d1ac" btn_icon="" btn_url="/install-solar-panels/" btn_target="_blank"][/tw_callout]', 'The State of Solar Power in California', '', 'publish', 'open', 'open', '', 'the-state-of-solar-power-in-california', '', '', '2015-04-01 21:50:18', '2015-04-01 21:50:18', '', 0, 'http://henergy.staging.wpengine.com/?p=2336', 0, 'post', '', 0),
(2338, 7, '2015-04-21 18:58:59', '2015-04-21 18:58:59', '<h4>With the California drought continuing and new water conservation laws going into effect, it is now more important than ever to try to limit water usage. Here''s some tips for conserving water at your own home:</h4>\r\n\r\n<strong><em>Turn off the faucet while brushing teeth and/or shaving.</em></strong> This is one of the easiest ways to reduce water usage, and can actually save you up to 3,000 gallons per year!\r\n\r\n<strong><em>Only run full loads</em></strong> in your dishwasher and washing machine. Speaking of dishes, many dishwashers actually use <em>less</em> water than washing by hand. If you do wash by hand, however, don''t leave the tap running. Instead, fill one basin with soapy water for scrubbing, and the other with clean rinse water.\r\n\r\n<strong><em>Install water efficient fixtures and appliances.</em></strong> Look for faucets, shower heads, toilets, and other water-using appliances with WaterSense and EnergyStar labels.\r\n\r\n<strong><em>Shorten your showers.</em></strong> While it is generally recommended to limit your showers to 5 minutes, even shortening your shower time by 1-2 minutes can save you 150 gallons each month. Also, consider turning the water off while lathering your hair or body.\r\n\r\n<strong><em>Place a few drops of food coloring in your toilet''s reservoir.</strong></em> If any color seeps into the bowl without flushing, there''s a leak that needs to be fixed.\r\n\r\n<strong><em>Collect spare water,</em></strong> such as from rinsing fruits and vegetables, dropped ice cubes, water ran while waiting for cool/hot water, etc, into a bowl or bucket and use it to water houseplants or your garden.\r\n\r\n<strong><em>Re-use the waste water from cleaning fishtanks.</em></strong> Use this nutrient-rich water for outdoor, non-edible plants.\r\n\r\n<strong><em>Limit your lawn watering</em></strong> and monitor runoff. Apply water only as fast as the soil can absorb it. If you notice water running over your sidewalk or into the street, lessen the amount you''re using. Aerating your lawn by putting in holes every 6 inches will allow more water to be absorbed, and also ensures that more water reaches the roots.\r\n\r\n<strong><em>Install gutters and waterspouts</em></strong> to collect any runoff water from your roof when it does rain. Direct the waterspouts into large buckets or rain barrels to then use to water your lawn and garden, or straight onto water-needy plants or trees.\r\n\r\n<strong><em>If you own a pool,</em></strong> invest in a pool cover to not only keep out debris, but to limit water loss from evaporation, and reduce chemical use.\r\n\r\nLastly, <strong><em>check faucets, pipes, sprinklers, and appliances regularly for leaks.</em></strong> A faucet that drips once per second can waste approximately 5 gallons/day.', 'Water Conservation Tips for 2015', '', 'publish', 'open', 'open', '', 'water-conservation-tips-for-2015', '', '', '2015-04-21 18:58:59', '2015-04-21 18:58:59', '', 0, 'http://henergy.staging.wpengine.com/?p=2338', 0, 'post', '', 0),
(2339, 7, '2015-05-01 22:55:59', '2015-05-01 22:55:59', 'In 2012, Governor Brown issued a sweeping executive order directing all state agencies, departments, and other state entities to reduce their energy use by 20 percent by 2018 (compared to a 2003 baseline). Recently, a new website has been launched tracking their progress- and making it available to the public.\r\n\r\nAt <a href="http://www.greenbuildings.ca.gov/" rel="nofollow" target="_blank">http://www.greenbuildings.ca.gov/</a>, you can browse the progress made by each state department towards reaching the energy conservation goals. California''s State Buildings have already reached a 22% reduction in water usage, although the goal has been accelerated to 25% by the end of 2015 in light of the drought.\r\n\r\n[caption id="attachment_2342" align="aligncenter" width="650"]<img src="http://henergy.staging.wpengine.com/wp-content/uploads/2015/05/chart-asset-1-energy.png" alt="Snapshot from the new GreenBuildings.ca.gov website." width="650" height="319" class="size-full wp-image-2342" /> Snapshot from the new GreenBuildings.ca.gov website.[/caption]\r\nMany departments have made great progress with reducing energy usage. For example, the California Department of Health has shown a 30% reduction in energy usage at its buildings since 2003. Others however, are not making as much progress, and some have even shown an increase in energy usage. The California Office of Emergency Services, for example, has seen a 52% increase in energy consumption since 2003.\r\n\r\nOverall though, California State buildings have reduced their energy usage by 12%, and are on-track to meeting the 20% reduction goal.', 'Tracking California''s State Building''s Energy Conservation', '', 'publish', 'open', 'open', '', 'tracking-state-buildings-energy-conservation', '', '', '2015-05-01 23:04:35', '2015-05-01 23:04:35', '', 0, 'http://henergy.staging.wpengine.com/?p=2339', 0, 'post', '', 0),
(2342, 7, '2015-05-01 23:02:52', '2015-05-01 23:02:52', '', 'CA Gov Buildings Energy Use', 'Snapshot from the new GreenBuildings.ca.gov website.', 'inherit', 'open', 'open', '', 'chart-asset-1-energy', '', '', '2015-05-01 23:03:26', '2015-05-01 23:03:26', '', 2339, 'http://henergy.staging.wpengine.com/wp-content/uploads/2015/05/chart-asset-1-energy.png', 0, 'attachment', 'image/png', 0),
(2344, 7, '2015-05-12 17:54:27', '2015-05-12 17:54:27', 'Again this year, California''s Energy Conservation Network and the California Independent System Operator (ISO) will be running the Flex Alert system, and calls for residents and business owners to participate in the program.\r\n\r\n<h3>What is Flex Alert?</h3>\r\nA Flex Alert is a notification that goes out when there is an urgent need to conserve energy. Flex Alerts are typically put out when there is a high forecasted peaks in demand or when there are low power reserves caused by heat waves, storms, or unplanned generator outages. If this happens, a voluntary call is sent out to Californians to follow these steps:\r\n\r\n<ol>\r\n<li>Turn of all unnecessary lights, computers, and appliances.</li>\r\n<li>Postpone usage of major appliances until 6 pm.</li>\r\n<li>Turn your air conditioning thermostat to 78&deg;F or higher.</li>\r\n</ol>\r\n\r\nIn the past years, Californians participating in the Flex Alert program have achieved high levels of conservation during heat waves and other risks to the electric grid such as wildfires or when major power plants or power lines are unavailable.\r\n\r\nIt is anticipated that there will be a greater risk this year for rolling blackouts and power shortages. The main reasons include an overlapping of two major hazards: the historic drought, and approaching heat storms.\r\n\r\nIt is highly recommended for all California residents to sign up and participate in energy conservation when a Flex Alert is called. To sign up to receive Flex Alerts, and to learn more about the program, visit <a href="http://www.flexalert.org" target="_blank" rel="nofollow">www.flexalert.org</a>.', 'Flex Alerts- Emergency Energy Reduction', '', 'publish', 'open', 'open', '', 'flex-alerts-emergency-energy-reduction', '', '', '2015-05-12 17:54:27', '2015-05-12 17:54:27', '', 0, 'http://henergy.staging.wpengine.com/?p=2344', 0, 'post', '', 0),
(2346, 7, '2015-05-19 20:54:17', '2015-05-19 20:54:17', 'It''s no secret that California is a hotbed for solar. It seems like at least once a month, another large-scale solar farm is proposed. But it''s not just large solar operations that make California a leader in solar energy: it''s the residential installations as well.\r\n\r\nIt is estimated that nearly a quarter of a million homes in California have solar panels installed, and that number is expected to jump even further. Most companies offer some sort of incentive or rebate system, and many households are even eligible for governmental assistance if they wish to go solar. There are also volunteer organizations dedicated to installing solar panels in low-income areas, often paying some or all of the costs of the panels, and having volunteer contractors do the installations for free.\r\n\r\n<img src="http://henergy.staging.wpengine.com/wp-content/uploads/2015/05/Tesla-power-demand-illo-300x205.jpg" alt="Solar Generation vs Peak Demand" width="300" height="205" class="alignright size-full wp-image-2347" />Advances in technology are also making it easier for homeowners to make the switch. Solar panels are more efficient than ever generating more electricity per solar cell, not to mention the launch of Tesla''s home batteries has the world buzzing. It creates a new opportunity to store the excess solar energy generated during the day to save for use during times when solar production isn''t as high, creating a solution to the "no sun, no power" problem that was a major hangup with those considering solar energy. This chart, right, credit of extremetech.com, charts solar generation capacity vs peak times of energy use. Storage of the excess solar power generated during the day to use during other parts of the day allows homeowners to become more self-sustaining, and less reliant on the power grid.\r\n\r\nThe State of California has a goal set for 25% of its energy to come from renewable sources by 2016, and then up to 33% by 2020. The majority of this is expected to come from solar power. <a href="http://henergy.staging.wpengine.com/energy-efficiency/install-solar-panels/">Learn more about how you can switch to solar.</a>', 'California Leading the Nation in Solar Panel Installations', '', 'publish', 'open', 'open', '', 'california-leading-the-nation-in-solar-panel-installations', '', '', '2015-05-19 20:54:49', '2015-05-19 20:54:49', '', 0, 'http://henergy.staging.wpengine.com/?p=2346', 0, 'post', '', 0),
