(2352, 3, '2015-05-30 00:25:28', '2015-05-30 00:25:28', 'FREE PROGRAM\nPG&amp;E’s and SoCal Gas’s Energy Savings Assistance Program provides qualified\nrenters* and homeowners** with home improvements at no cost to help keep\nyour home more energy efficient, safe and comfortable.\nCALL NOW!\n(855) 789-3637\nAttic Insulation Window Cooler\nMicrowave Showerhead\nRefrigerator\nWasher\nLic #861507\nAn Authorized Pacific Gas and Electric Company\n&amp; Southern California Gas Company Contractor\nNumber of Persons\nin Hous ehold\nTotal Gross Annual\nHousehold Income\n1-2 $31,860 or less\n3 $40,180 or less\n4 $48,500 or less\n5 $56,820 or less\n6 $65,140 or less\n7 $73,460 or less\n8 $81,780 or less\nCheck the charts below to see if you qualify:\nOR\nPUBLIC ASSISTANCE PROGRAMS INCOME GUIDELINES\nFurnace Repair\nDoor Repair or Replace\nHome Sealing\nWater Heater Insulation Outlet Gaskets\n*Renters need written permission from landlords to receive program services\n**Homeowners may also be eligible to receive furnace and water heater repair or replacement services when existing natural gas units are deemed inoperable or hazardous.\nGlass Replacement\nIf you or any other person in your household recieves\nbenefints from any of the following programs:\nMedi-Cal / Medicaid\nMedi-Cal for Families A &amp; B\nWomen, Infant &amp; Children (WIC)\nCalWORKs (TANF) or Tribal TANF\nHead Start Income Eligible - Tribal Only\nBureau of Indian Affairs General Assistance\nCalFresh (Food Stamps)\nNational School Lunch Program (NSLP)\nLow-Income Home Energy Assistance Program (LIHEAP)\nSupplemental Security Insurance (SSI)\nIf the total annual household income, before\ntaxes, meets the thresholds below:\n<table>\n<tbody>\n<tr>\n<td>Spanish Translation….\nQ1. Vamos a empezar con su código postal.Q2. Ahora, nos dicen cuántas personas viven en el hogar.\n\nQ3. ¿Alguna de las personas que viven en el hogar reciben cualquiera de los siguientes programas de asistencia pública?\n<ul>\n	<li>Medi-Cal / Medicaid</li>\n	<li>Medi-Cal para familias A y B</li>\n	<li>Mujeres, Infantes y Niños (WIC)</li>\n	<li>CalWORKs (TANF) o TANF Tribal</li>\n	<li>Elegible Ingreso de Ventaja Inicial - Sólo tribal</li>\n	<li>Oficina de Asistencia indio de Asuntos Generales</li>\n	<li>CalFresh, SNAP, Cupones de Alimentos</li>\n	<li>Programa Nacional de Almuerzos Escolares (NSLP)</li>\n	<li>Programa de Hogares de Bajos Ingresos de Asistencia de Energía (LIHEAP)</li>\n	<li>Seguridad de Ingreso Suplementario (SSI)</li>\n</ul>\nIf Yes Then skip to Q5, otherwise:\nQ4. Antes de impuestos, es el ingreso total del hogar menos de:\n\n[match the household size to the income provided]\n\n1 - $ 31,860\n\n2 - $ 31,860\n\n3 - $ 40,180\n\n4 - $ 48.500\n\n5 - $ 56.820\n\n6 - $ 65.140\n\n7 - $ 73,460\n\n8 - $ 81,780\n\n9 - * Add $8,320 for each additional house member.\nIf yes Q5, otherwise  "En este momento usted no cumple con los requisitos para participar en el Programa de Asistencia de Ahorro de Energía. Las pautas cambian a menudo, te animamos a probar de nuevo en unos pocos de semana. Gracias”\nQ5. Proporcione por favor su [Nombre *] [Apellido *] [* Dirección] [Ciudad] [Código Postal *] [Teléfono *] [Correo] * indica campo obligatorio\n\nUpon submit forward record to ivd@highlandsenergy.net and display message "Nos comunicaremos con usted dentro de 24 horas durante horas de oficina Lunes - Viernes 9 a.m.-6 p.m. para continuar su inscripción.”\n\nALSO, the owner of the company, Leonel, asked we add our CSLB lic number to the website too.  I suggest adding it either in the header or the footer under the Contact Highlands section.  Please find the best place to place it based on your creative eye. Our Contractors State License Board number is: <a href="https://www2.cslb.ca.gov/OnlineServices/CheckLicenseII/LicenseDetail.aspx?LicNum=861507">861507</a>.  It should appear on all pages.</td>\n</tr>\n</tbody>\n</table>\n&nbsp;', 'ESAP', '', 'inherit', 'open', 'open', '', '2349-autosave-v1', '', '', '2015-05-30 00:25:28', '2015-05-30 00:25:28', '', 2349, 'http://henergy.staging.wpengine.com/2349-autosave-v1/', 0, 'revision', '', 0),
