sing, even if you are planning on coming back in just a few minutes. Try to get into the habit of turning off the lights whenever you leave a room.\n\n<h5><i class="fa fa-moon-o" style="font-size:30px;"></i> Energy Savings Myth #8: Insulating the ceiling will just cause more heat to leak out of the windows.</h5>\nUnless your home is highly pressurized (hint: it''s not), adding extra insulation anywhere in your home is not going to force air out of other places.', '8 Energy Savings Myths', '', 'inherit', 'open', 'open', '', '2391-autosave-v1', '', '', '2015-06-05 22:13:58', '2015-06-05 22:13:58', '', 2391, 'http://henergy.staging.wpengine.com/2391-autosave-v1/', 0, 'revision', '', 0),
